iations.'=>'Ogranicz zestaw wyników do wariantów produktów do pobrania.','Limit result set to virtual product variations.'=>'Ogranicz zestaw wyników do wariantów wirtualnych produktów.','5 of 5 stars'=>'5 z 5 gwiazdek','4 of 5 stars'=>'4 z 5 gwiazdek','3 of 5 stars'=>'3 z 5 gwiazdek','2 of 5 stars'=>'2 z 5 gwiazdek','1 of 5 stars'=>'1 z 5 gwiazdek','Hide password'=>'Ukryj hasło','Show password'=>'Pokaż hasło','Warning: Sale prices will be removed if they are not lower than regular prices.'=>'Ostrzeżenie: ceny wyprzedażowe zostaną usunięte, jeśli nie są niższe od cen regularnych.','Exclude product variations with any of the statuses from result set.'=>'Wyklucz z zestawu wyników warianty produktów o dowolnym statusie.','Used in the heading of the coming soon pageopening soon'=>'otwarcie wkrótce','Your account with %s is using a temporary password. We emailed you a link to change your password.'=>'Twoje konto z %s używa tymczasowego hasła. Wysłaliśmy ci link do zmiany hasła.','block descriptionDisplay a short description about a product.'=>'Wyświetla krótki opis produktu.','block titleProduct Summary'=>'Podsumowanie produktu','block descriptionDisplay an input field customers can use to select the number of products to add to their cart. '=>'Wyświetl pole wprowadzania, w którym klienci mogą wybrać liczbę produktów, które chcą dodać do koszyka. ','Products in cart'=>'Produkty w koszyku','Sync with theme'=>'Synchronizacja z motywem','WooCommerce Settings'=>'Ustawienia WooCommerce','Sorry, your order on %1$s was unsuccessful. Your order details are below, with a link to try your payment again: %2$s'=>'Przepraszamy, twoje zamówienie na %1$s nie powiodło się. Szczegóły twojego zamówienia znajdują się poniżej, wraz z odnośnikiem do ponownej próby płatności: %2$s','Stock availability class.'=>'Klasa dostępności zapasów.','Stock availability text.'=>'Tekst dostępności zapasów.','Information about the product\'s availability.'=>'Informacje o dostępności produktu.','Order status slug.'=>'Uproszczona nazwa statusu zamówienia.','Order statuses not found'=>'Nie znaleziono statusów zamówień','Enable order data caching in the datastore. This feature only works with high-performance order storage.'=>'Włącz buforowanie danych zamówień w magazynie danych. Ta funkcja działa tylko z wysokowydajnym magazynem zamówień.','HPOS Data Caching'=>'Buforowanie danych HPOS','Rate limit Checkout'=>'Limit prób zamówienia','Enables rate limiting for Checkout place order and Store API /checkout endpoint. To further control this, refer to <a href="%s" target="_blank">rate limiting documentation</a>.'=>'Włącza ograniczenie liczby prób złożenia zamówienia na stronie Zamówienia oraz przez punkt końcowy /checkout API sklepu. Aby dostosować opcje, zapoznaj się z <a href="%s" target="_blank">dokumentacją limitu prób</a>.','Viva.com Smart Checkout'=>'Inteligentna płatność Viva.com','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell in store and track sales and inventory in one place.'=>'Bezpiecznie akceptuj karty kredytowe i debetowe z jedną niską stawką, bez niespodziewanych opłat (dostępne są stawki własne). Sprzedawaj w sklepie i śledź sprzedaż oraz zapasy w jednym miejscu.','Clearpay allows customers to receive products immediately and pay for purchases over four installments, always interest-free.'=>'Clearpay umożliwia klientom natychmiastowe otrzymywanie produktów i płacenie za zakupy w czterech ratach, zawsze bez odsetek.','Clearpay'=>'Clearpay','Affirm\'s tailored Buy Now Pay Later programs remove price as a barrier, turning browsers into buyers, increasing average order value, and expanding your customer base.'=>'Dostosowane programy firmy Affirm "kup teraz zapłać później" usuwają cenę jako barierę, zmieniając przeglądających w kupujących, zwiększając średnią wartość zamówienia i poszerzając bazę klientów.','Accept payments with Woo'=>'Akceptuj płatności za pomocą Woo','Accept credit and debit cards on your WooCommerce store with advanced features like partial refunds, full/partial captures, and 3D Secure security.'=>'Akceptuj karty kredytowe i debetowe w swoim sklepie WooCommerce dzięki zaawansowanym funkcjom, takim jak częściowe zwroty, pełne/częściowe przechwytywanie i zabezpieczenia 3D Secure.','Tilopay'=>'Tilopay','Stripe'=>'Stripe','Enable PayU\'s exclusive plugin for WooCommerce to start accepting payments in 100+ payment methods available in India including credit cards, debit cards, UPI, & more!'=>'Włącz ekskluzywną wtyczkę PayU dla WooCommerce, aby zacząć akceptować płatności w ponad 100 metodach płatności dostępnych w Indiach, w tym kartami kredytowymi, debetowymi, UPI i nie tylko!','PayU India'=>'PayU Indie','Payoneer Checkout is the next generation of payment processing platforms, giving merchants around the world the solutions and direction they need to succeed in today\'s hyper-competitive global market.'=>'Payoneer Checkout to platforma przetwarzania płatności nowej generacji, zapewniająca sprzedawcom na całym świecie rozwiązania i wskazówki, których potrzebują, aby odnieść sukces na dzisiejszym niezwykle konkurencyjnym rynku globalnym.','A European payments solution that allows you to accept payments in over 25 countries and multiple currencies.'=>'Europejskie rozwiązanie płatnicze, które pozwala akceptować płatności w ponad 25 krajach i wielu walutach.','Credit/debit cards, Apple Pay, Google Pay, and more.'=>'Karty kredytowe/debetowe, Apple Pay, Google Pay i nie tylko.','PayPal Payments lets you offer PayPal, Venmo (US only), Pay Later options and more.'=>'Płatności PayPal pozwalają ci oferować opcje PayPal, Venmo (tylko w USA), Pay Later i inne.','Safe and secure payments using your customer\'s PayPal account.'=>'Bezpieczne płatności przy użyciu konta PayPal twojego klienta.','Paymob is a leading payment gateway in the Middle East and Africa. Accept payments online and in-store with Paymob.'=>'Paymob to wiodąca bramka płatnicza na Bliskim Wschodzie i w Afryce. Akceptuj płatności online i w sklepie z Paymob.','Paymob'=>'Paymob','The Payfast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa\'s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.'=>'Rozszerzenie Payfast dla WooCommerce umożliwia przyjmowanie płatności kartą kredytową i EFT za pośrednictwem jednej z najpopularniejszych bramek płatniczych w RPA. Nie ponosisz żadnych opłat instalacyjnych ani miesięcznych kosztów subskrypcji. Wybranie tego rozszerzenia skonfiguruje twój sklep do używania randa południowoafrykańskiego jako wybranej waluty.','Your trusted payments partner in Asia and around the world.'=>'Twój zaufany partner w zakresie płatności w Azji i na całym świecie.','Antom'=>'Antom','The category of the suggestion.'=>'Kategoria sugestii.','The tags associated with the suggestion.'=>'Tagi powiązane z sugestią.','The URL of the icon (square aspect ratio).'=>'Adres URL ikonki (kwadratowy współczynnik proporcji).','The URL of the image.'=>'Adres URL obrazku.','The description of the suggestion.'=>'Opis sugestii.','The title of the suggestion.'=>'Tytuł sugestii.','The type of the suggestion.'=>'Rodzaj sugestii.','The priority of the suggestion.'=>'Priorytet sugestii.','The unique identifier for the suggestion.'=>'Unikalny identyfikator sugestii.','A suggestion with full details.'=>'Sugestia z pełnymi szczegółami.','The URL to hide the suggestion.'=>'Adres URL do ukrycia sugestii.','The link to hide the suggestion.'=>'Odnośnik do ukrycia sugestii.','The URL to dismiss the incentive.'=>'Adres URL do odrzucenia zachęty.','The link to dismiss the incentive.'=>'Odnośnik do odrzucenia zachęty.','Context ID in which the incentive was dismissed.'=>'Identyfikator kontekstu, w którym zachęta została odrzucona.','The badge label for the incentive.'=>'Etykieta identyfikatora dla zachęty.','The URL to the terms and conditions for the incentive.'=>'Adres URL do zasad i warunków zachęty.','The call to action label for the incentive.'=>'Etykieta wezwania do działania dla zachęty.','The short description of the incentive. It can contain stylistic HTML.'=>'Krótki opis zachęty. Może zawierać stylistyczny HTML.','The incentive description. It can contain stylistic HTML.'=>'Opis zachęty. Może zawierać stylistyczny HTML.','The incentive title. It can contain stylistic HTML.'=>'Tytuł zachęty. Może zawierać stylistyczny kod HTML.','The incentive promo ID. This ID need to be fed into the onboarding flow.'=>'Identyfikator promocji motywacyjnej. Ten identyfikator musi zostać wprowadzony do procesu wdrażania.','The incentive unique ID. This ID needs to be used for incentive dismissals.'=>'Unikalny identyfikator zachęty. Ten identyfikator musi być używany do zwolnień motywacyjnych.','The active incentive for the provider.'=>'Aktywna zachęta dla dostawcy.','The suggestion ID matching this provider.'=>'Identyfikator sugestii pasujący do tego dostawcy.','Tag associated with the provider.'=>'Znacznik powiązany z dostawcą.','The tags associated with the provider.'=>'Tagi powiązane z dostawcą.','The URL of the payment method icon or a base64-encoded SVG image.'=>'Adres URL ikonki metody płatności lub obrazek SVG zakodowany w base64.','The description of the payment method. It can contain basic HTML.'=>'Opis metody płatności. Może zawierać podstawowy kod HTML.','The title of the payment method. Does not include HTML tags.'=>'Tytuł metody płatności. Nie zawiera znaczników HTML.','Whether the payment method should be required (and force-enabled) or not.'=>'Określa, czy metoda płatności powinna być wymagana (i wymuszona), czy nie.','Whether the payment method should be recommended as enabled or not.'=>'Określa, czy metoda płatności powinna być zalecana jako włączona, czy nie.','The sort order of the payment method.'=>'Kolejność sortowania metody płatności.','The unique identifier for the payment method.'=>'Unikalny identyfikator metody płatności.','The details for a recommended payment method.'=>'Szczegóły dotyczące zalecanej metody płatności.','The list of recommended payment methods details for the payment gateway.'=>'Lista zalecanych metod płatności dla bramki płatności.','The start/continue onboarding link for the payment gateway.'=>'Łącze rozpoczęcia/kontynuowania procesu wdrażania dla bramki płatności.','The URL to start/continue onboarding for the payment gateway.'=>'Adres URL do rozpoczęcia/kontynuowania procesu wdrażania dla bramki płatności.','Whether the onboarding process is completed.'=>'Czy proces wdrażania został zakończony.','Whether the onboarding process is started.'=>'Czy proces wdrażania został rozpoczęty.','The state of the onboarding process.'=>'Stan procesu wdrażania.','Onboarding-related details for the provider.'=>'Wdrażanie - szczegółowe informacje dla dostawcy.','The URL to the settings page for the payment gateway.'=>'Adres URL strony ustawień bramki płatności.','The link to the settings page for the payment gateway.'=>'Odnośnik do strony ustawień bramki płatności.','The management details of the provider.'=>'Szczegóły dotyczące zarządzania dostawcą.','Whether the provider is in dev mode. Having this true usually leads to forcing test payments. '=>'Określa, czy dostawca jest w trybie deweloperskim. Posiadanie tej informacji zazwyczaj prowadzi do wymuszenia płatności testowych. ','Whether the provider is in test mode for payments processing.'=>'Określa, czy dostawca jest w trybie testowym przetwarzania płatności.','Whether the provider needs setup.'=>'Określa, czy dostawca wymaga konfiguracji.','Whether the provider has a payments processing account connected.'=>'Określa, czy dostawca ma podłączone konto przetwarzania płatności.','Whether the provider is enabled for use on checkout.'=>'Określa, czy dostawca jest włączony do użytku przy finalizacji zamówienia (kasie).','The general state of the provider with regards to it\'s payments processing.'=>'Ogólny stan dostawcy w odniesieniu do przetwarzania płatności.','The URL of the link.'=>'Adres URL odnośnika.','The type of the link.'=>'Rodzaj odnośnika.','Links for the provider.'=>'Odnośniki dla dostawcy.','The URL of the provider icon (square aspect ratio - 72px by 72px).'=>'Adres URL ikonki dostawcy (kwadratowe proporcje - 72px na 72px).','The URL of the provider image.'=>'Adres URL obrazku dostawcy.','The status of the plugin.'=>'Status wtyczki.','The plugin main file. This is a relative path to the plugins directory.'=>'Główny plik wtyczki. Jest to względna ścieżka do katalogu wtyczek.','The slug of the plugin.'=>'Uproszczona nazwa wtyczki.','The type of the plugin.'=>'Rodzaj wtyczki.','The corresponding plugin details of the provider.'=>'Odpowiednie szczegóły wtyczki dostawcy.','Supported features for this provider.'=>'Funkcje obsługiwane przez tego dostawcę.','The description of the provider.'=>'Opis dostawcy.','The title of the provider.'=>'Tytuł dostawcy.','The type of payment provider. Use this to differentiate between the various items in the list and determine their intended use.'=>'Rodzaj dostawcy płatności. Użyj tego, aby rozróżnić różne pozycje na liście i określić ich przeznaczenie.','The sort order of the provider.'=>'Kolejność sortowania dostawcy.','The unique identifier for the provider.'=>'Unikalny identyfikator dostawcy.','A payment provider in the context of the main Payments Settings page list.'=>'Dostawca płatności w kontekście głównej listy strony Ustawienia płatności.','The description of the category.'=>'Opis kategorii.','The title of the category.'=>'Tytuł kategorii.','The priority of the category.'=>'Priorytet kategorii.','The unique identifier for the category.'=>'Unikalny identyfikator kategorii.','A suggestion category.'=>'Kategoria sugestii.','The suggestion categories.'=>'Kategorie sugestii.','The list of suggestions, excluding the ones part of the providers list.'=>'Lista sugestii, z wyłączeniem sugestii należących do listy dostawców.','The ordered offline payment methods providers list.'=>'Lista dostawców zamówionych metod płatności offline.','The ordered providers list. This includes registered payment gateways, suggestions, and offline payment methods group entry. The individual offline payment methods are separate.'=>'Lista zamówionych dostawców. Obejmuje ona zarejestrowane bramki płatności, sugestie i wpis grupy metod płatności offline. Poszczególne metody płatności offline są oddzielne.','The order value must be an integer.'=>'Wartość zamówienia musi być liczbą całkowitą.','The ordering argument must be an object with provider IDs as keys and numeric values as values.'=>'Argument zamawiania musi być obiektem z identyfikatorami dostawców jako kluczami i wartościami numerycznymi jako wartościami.','The ordering argument must be an object.'=>'Argument zamawiania musi być obiektem.','The location argument must be a valid ISO3166 alpha-2 country code.'=>'Argument lokalizacji musi być prawidłowym kodem kraju ISO3166 alpha-2.','The location argument must be a string.'=>'Argument lokalizacji musi być ciągiem znaków.','The context ID for which to dismiss the incentive. If not provided, will dismiss the incentive for all contexts.'=>'Identyfikator kontekstu, dla którego ma zostać odrzucona zachęta. Jeśli nie zostanie podany, zachęta zostanie odrzucona dla wszystkich kontekstów.','A map of provider ID to integer values representing the sort order.'=>'Mapa identyfikatora dostawcy na wartości całkowite reprezentujące kolejność sortowania.','ISO3166 alpha-2 country code. Defaults to WooCommerce\'s base location country.'=>'Kod kraju ISO3166 alpha-2. Domyślnie jest to kraj lokalizacji bazowej WooCommerce.','The ISO3166 alpha-2 country code to save for the current user.'=>'Kod kraju ISO3166 alpha-2 do zapisania dla bieżącego użytkownika.','Accept payments offline using multiple different methods. These can also be used to test purchases.'=>'Akceptuj płatności offline przy użyciu wielu różnych metod. Możesz je również wykorzystać do testowania zakupów.','Take offline payments'=>'Przyjmuj płatności offline','Give your shoppers additional ways to pay.'=>'Zapewnij kupującym dodatkowe sposoby płatności.','Payment Providers'=>'Dostawcy płatności','Offer flexible payment options to your shoppers.'=>'Zaoferuj kupującym elastyczne opcje płatności.','Buy Now, Pay Later'=>'Kup teraz, zapłać później','Invalid suggestion ID.'=>'Nieprawidłowy identyfikator sugestii.','Transient saved for key %s.'=>'Stan przejściowy zapisany dla klucza %s.','Error saving transient. Please try again.'=>'Błąd zapisu stanu przejściowego. Spróbuj ponownie.','Error sending test email. Please try again.'=>'Błąd wysyłania testowej wiadomości e-mail. Spróbuj ponownie.','Test email sent to %s.'=>'Testowa wiadomość e-mail wysłana do %s.','Allow shoppers to fast-track the checkout process with express options like Apple Pay and Google Pay.'=>'Pozwól kupującym na przyspieszenie procesu zamówienia (płatności) dzięki opcjom ekspresowym, takim jak Apple Pay i Google Pay.','A subject for provided email type after filters are applied and placeholders replaced.'=>'Temat dla podanego rodzaju wiadomości e-mail po zastosowaniu filtrów i zastąpieniu symboli zastępczych.','Email address to send the email preview to.'=>'Adres e-mail, na który ma zostać wysłany podgląd wiadomości e-mail.','Phone number'=>'Numer telefonu','Selling platforms.'=>'Platformy sprzedaży.','Selling online answer.'=>'Odpowiedź dotycząca sprzedaży online.','Business choice.'=>'Wybór firmy.','The Core Profiler step to mark as complete.'=>'Krok programu Core Profiler do oznaczenia jako ukończony.','Coming Soon template headingStay tuned.'=>'Bądź na bieżąco.','Something big is brewing! Our store is in the works – Launching shortly!'=>'Szykuje się coś wielkiego! Nasz sklep jest w przygotowaniu - start już wkrótce!','The email type to get subject for.'=>'Rodzaj wiadomości e-mail, dla której chcesz uzy