eativity, curiosity, and courage for a truly fulfilling journey.'=>'Poruszając się po skomplikowanej tkaninie życia, wybory rozwijają ścieżki do niezwykłych, wymagających kreatywności, ciekawości i odwagi, aby podróż była naprawdę satysfakcjonująca.','Create anything'=>'Stwórz cokolwiek','Meet us'=>'Poznaj nas','Committed to a greener lifestyle'=>'Zaangażowanie w bardziej ekologiczny styl życia','Our passion is crafting mindful moments with locally sourced, organic, and sustainable products. We\'re more than a store; we\'re your path to a community-driven, eco-friendly lifestyle that embraces premium quality.'=>'Naszą pasją jest tworzenie świadomych chwil dzięki lokalnie pozyskiwanym, organicznym i zrównoważonym produktom. Jesteśmy czymś więcej niż sklepem; jesteśmy twoją drogą do ekologicznego stylu życia opartego na społeczności, który obejmuje najwyższą jakość.','Unidentified action %s: we were unable to mark this action as having completed. It may may have been deleted by another process.'=>'Niezidentyfikowana akcja %s: nie mogliśmy oznaczyć tej akcji jako zakończonej. Mogła ona zostać usunięta przez inny proces.','Unidentified action %s: we were unable to mark this action as having failed. It may may have been deleted by another process.'=>'Niezidentyfikowana akcja %s: nie mogliśmy oznaczyć tej akcji jako zakończonej niepowodzeniem. Mogła ona zostać usunięta przez inny proces.','Unidentified action %s: we were unable to determine the date of this action. It may may have been deleted by another process.'=>'Niezidentyfikowana akcja %s: nie byliśmy w stanie określić daty tej akcji. Mogła ona zostać usunięta przez inny proces.','Unidentified action %s: we were unable to delete this action. It may may have been deleted by another process.'=>'Niezidentyfikowana akcja %s: nie mogliśmy usunąć tej akcji. Mogła ona zostać usunięta przez inny proces.','Unidentified action %s: we were unable to cancel this action. It may may have been deleted by another process.'=>'Niezidentyfikowana akcja %s: nie mogliśmy anulować tej akcji. Mogła ona zostać usunięta przez inny proces.','GTIN, UPC, EAN or ISBN.'=>'GTIN, UPC, EAN lub ISBN.','Order sort items ascending or descending.'=>'Sortuj elementy rosnąco lub malejąco.','Legacy REST API enabled?'=>'Starszy interfejs API REST włączony?','An unexpected error occurred while generating the refund.'=>'Wystąpił nieoczekiwany błąd podczas generowania zwrotu.','Invalid slug.'=>'Nieprawidłowa uproszczona nazwa.','Order query argument (%s) is not supported on the current order datastore.'=>'Argument zapytania o zamówienie (%s) nie jest obsługiwany w bieżącym magazynie danych zamówień.' . "\0" . 'Argumenty zapytania o zamówienie (%s) nie są obsługiwane w bieżącym magazynie danych zamówień.' . "\0" . 'Argument zapytania o zamówienie (%s) nie jest obsługiwany w bieżącym magazynie danych zamówień.','Does your site have the Legacy REST API enabled?'=>'Czy twoja witryna ma włączony starszy interfejs API REST?','Legacy API enabled'=>'Starszy interfejs API włączony','Repeat fetches made within a reasonable window of time (by default, 30 minutes) will not be counted twice. This is a generally reasonably way to enforce download limits in relation to ranged requests. %1$sLearn more.%2$s'=>'Powtórne pobrania dokonane w rozsądnym przedziale czasu (domyślnie 30 minut) nie będą liczone dwukrotnie. Jest to ogólnie rozsądny sposób na egzekwowanie limitów pobierania w odniesieniu do żądań wielokrotnych. %1$sDowiedz się więcej.%2$s','Stock Keeping Unit.'=>'Jednostka magazynowa (SKU).','Local pickup: Manage existing pickup locations in the <a href="%s">Local pickup settings page</a>.'=>'Odbiór lokalny: zarządzaj istniejącymi lokalizacjami odbioru na <a href="%s">stronie ustawień lokalnego odbioru</a>.','Count downloads even if only part of a file is fetched.'=>'Zliczaj pobrane pliki, nawet jeśli pobierana jest tylko część pliku.','Count partial downloads'=>'Zliczanie pobrań częściowych','New users receive an email to set up t