ych nie obsługuje aktualizacji zleceń.','Please review the errors above.'=>'Proszę sprawdzić błędy powyżej.','New custom field name'=>'Nazwa nowego własnego pola','WooCommerce Blocks development mode requires files to be built. From the root directory, run %1$s to ensure your node version is aligned, run %2$s to install dependencies, %3$s to build the files or %4$s to build the files and watch for changes.'=>'Tryb deweloperski WooCommerce Blocks wymaga zbudowania plików. Z katalogu głównego uruchom %1$s, aby upewnić się, że wersja węzła jest zgodna, uruchom %2$s, aby zainstalować zależności, %3$s, aby zbudować pliki lub %4$s, aby zbudować pliki i obserwować zmiany.','Overriding existing data with an already registered key is not allowed'=>'Zastępowanie istniejących danych już zarejestrowanym kluczem jest niedozwolone','Key for the data being registered must be a string'=>'Klucz dla rejestrowanych danych musi być ciągiem znaków','The metaboxhidden_product meta from the user metas.'=>'Meta metaboxhidden_product z meta użytkownika.','Set up your payment methods and accept credit and debit cards, cash, bank transfers and money from your Mercado Pago account. Offer safe and secure payments with Latin America’s leading processor.'=>'Skonfiguruj swoje metody płatności i akceptuj karty kredytowe i debetowe, gotówkę, przelewy bankowe i pieniądze z twojego konta Mercado Pago. Oferuj bezpieczne płatności z wiodącym dostawcą usług płatniczych w Ameryce Łacińskiej.','Mercado Pago'=>'Mercado Pago','Grow your business'=>'Rozwijaj swoją firmę','Collect sales tax'=>'Naliczaj podatek','Add your products'=>'Dodaj produkty','It\'s time to celebrate – you\'re ready to launch your store! Woo! Hit the button to preview your store and make it public.'=>'Nadszedł czas na świętowanie - jesteś gotowy do uruchomienia swojego sklepu! Woo! Naciśnij przycisk, aby wyświetlić podgląd swojego sklepu i upublicznić go.','Launch your store'=>'Uruchom swój sklep','Get your products shipped'=>'Wysyłaj swoje produkty','Current price is: %s.'=>'Aktualna cena wynosi: %s.','Original price was: %s.'=>'Pierwotna cena wynosiła: %s.','Checkout can be customized <a href="%s">in the Editor</a> with your active theme.'=>'Formularz zamówienia może być dostosowany <a href="%s">w edytorze</a> w używanym motywie.','⚠️ WooCommerce attempted to install <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but the installation failed (see error details in <a href="%4$s">the WooCommerce logs</a>). Please install and activate the plugin manually. <a href="%5$s">More information</a>'=>'⚠️ WooCommerce próbował zainstalować <a href="%1$s">wtyczkę starszy interfejs REST API</a>, ponieważ ta witryna ma <a href="%2$s">włączony Legacy REST API</a> lub ma <a href="%3$s">zdefiniowane legacy webhooks</a>, ale instalacja nie powiodła się (zobacz szczegóły błędu w <a href="%4$s">logach WooCommerce</a>). Zainstaluj i aktywuj wtyczkę ręcznie. <a href="%5$s">Więcej informacji</a>','ℹ️ WooCommerce installed and activated <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>. <a href="%4$s">More information</a>'=>'ℹ️ WooCommerce zainstalował i aktywował <a href="%1$s">wtyczkę starszy interfejs REST API</a>, ponieważ ta witryna ma <a href="%2$s">włączony Legacy REST API</a> lub ma <a href="%3$s">zdefiniowane legacy webhooks</a>. <a href="%4$s">Więcej informacji</a>','WooCommerce installed the Legacy REST API plugin but failed to activate it, see context for more details.'=>'WooCommerce zainstalował wtyczkę Legacy REST API, ale nie udało się jej aktywować, zobacz kontekst, aby uzyskać więcej informacji.','⚠️ WooCommerce installed <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but it failed to activate it (see error details in <a href="%4$s">the WooCommerce logs</a>). Please go to <a href="%5$s">the plugins page</a> and activate it manually. <a href="%6$s">More information</a>'=>'⚠️ WooCommerce zainstalował <a href="%1$s">wtyczkę Legacy REST API</a>, ponieważ ta witryna ma <a href="%2$s">włączoną wtyczkę Legacy REST API</a> lub <a href="%3$s">zdefiniowane legacy webhooks</a>, ale nie udało się jej aktywować (zobacz szczegóły błędu w <a href="%4$s">logach WooCommerce</a>). Przejdź do <a href="%5$s">strony wtyczek</a> i aktywuj ją ręcznie. <a href="%6$s">Więcej informacji</a>','Please enter a valid email to use coupon code "%s".'=>'Wpisz poprawny adres e-mail, aby użyć kuponu „%s”.','Please enter a valid email at checkout to use coupon code "%s".'=>'Wpisz poprawny adres e-mail na stronie zamówienia, aby użyć kuponu „%s”.','To allow logging, make %s writable.'=>'Aby zezwolić na rejestrowanie, ustaw %s jako zapisywalne.','Local pickup: Set up pickup locations in the <a href="%s">Local pickup settings page</a>.'=>'Odbiór osobisty: skonfiguruj miejsca odbioru na <a href="%s">stronie ustawień odbioru osobistego</a>.','Explore a new enhanced delivery method that allows you to easily offer one or more pickup locations to your customers in the <a href="%s">Local pickup settings page</a>.'=>'Poznaj nową, ulepszoną metodę dostawy, która pozwala łatwo zaoferować klientom jedną lub więcej lokalizacji odbioru na stronie <a href="%s">Ustawienia odbioru lokalnego</a>.','Gathering usage data allows us to tailor your store setup experience, offer more relevant content, and help make WooCommerce better for everyone.'=>'Zbieranie danych użytkowania pozwala nam dostosować doświadczenie z konfigurowaniem twojego sklepu, oferować bardziej dopasowane treści i pomagać uczynić WooCommerce lepszym dla wszystkich.','Please <a href="%1$s">activate the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions.'=>'Proszę <a href="%1$s">włączyć WooCommerce.com Update Manager</a>, aby nadal otrzymywać aktualizacje i pomoc techniczną w ramach swoich subskrypcji WooCommerce.com.','Please <a href="%1$s">Install the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions. Alternatively, you can <a href="%2$s">download</a> and install it manually.'=>'Proszę <a href="%1$s">zainstalować WooCommerce.com Update Manager</a>, aby nadal otrzymywać aktualizacje i pomoc techniczną w ramach swoich subskrypcji WooCommerce.com. Możesz ją również <a href="%2$s">pobrać</a> i zainstalować ręcznie.',' Activate WooCommerce.com Update Manager to update.'=>' Włącz WooCommerce.com Update Manager, aby zaktualizować.',' <a href="%1$s">Install WooCommerce.com Update Manager</a> to update.'=>' <a href="%1$s">Zainstaluj WooCommerce.com Update Manager</a>, aby zaktualizować.','block keywordtextarea'=>'pole tekstowe','block keywordrich-text'=>'tekst sformatowany','block descriptionA text-area field for use in the product editor.'=>'Pole tekstowe do wykorzystania w edytorze produktu.','block titleProduct textarea block'=>'Blok tekstowy produktu','block keywordsubsection'=>'podsekcja','block descriptionThe product subsection description.'=>'Opis podsekcji produktu.','block titleProduct subsection description'=>'Opis podsekcji produktu','Stop converting'=>'Zatrzymaj konwersję','Stop converting order coupon data to the simplified format'=>'Zatrzymaj konwersję danych zamówień o kuponach do uproszczonego formatu','Convert order coupon data to the simplified format'=>'Przekonwertuj danych zamówień o kuponach do uproszczonego formatu','Background process for coupon meta conversion started'=>'Proces konwersji metadanych kuponów w tle został uruchomiony','Background process for coupon meta conversion stopped'=>'Proces konwersji metadanych kuponów w tle został zatrzymany','Background process for 