eduled action to delete expired transient files. Expired files won\'t be automatically deleted until the \'Schedule expired transient files cleanup\' tool is run again.'=>'Usuń obecnie zaplanowaną akcję usuwania przedawnionych plików tymczasowych. Przedawnione pliki nie zostaną automatycznie usunięte, dopóki narzędzie „Zaplanuj czyszczenie przeterminowanych plików tymczasowych” nie zostanie ponownie uruchomione.','Medium'=>'Medium','Tip: By suggesting complementary products in the cart using cross-sells, you can significantly increase the average order value.'=>'Wskazówka: Sugerując w koszyku produkty uzupełniające za pomocą cross-sell, możesz znacząco zwiększyć średnią wartość zamówienia.','By suggesting complementary products in the cart using cross-sells, you can significantly increase the average order value. %1$sLearn more about linked products%2$s'=>'Sugerując w koszyku produkty uzupełniające za pomocą cross-sell, możesz znacząco zwiększyć średnią wartość zamówienia. %1$sDowiedz się więcej o produktach powiązanych%2$s','Log files are stored in this directory: %s'=>'Pliki dziennika są przechowywane w katalogu: %s','Database settings'=>'Ustawienia bazy danych','File system settings'=>'Ustawienia plików','Log entries are stored in this database table: %s'=>'Wpisy dziennika w bazie danych są przechowywane w tabeli: %s','You do not have permission to manage logging settings.'=>'Brak uprawnień do zarządzania ustawieniami logowania.','⚠️ This directory does not appear to be writable.'=>'⚠️ Wygląda na to, że ten katalog nie jest zapisywalny.','Unable to start synchronization. The link you followed may have expired.'=>'Nie można rozpocząć synchronizacji. Możliwe, że kliknięty odnośnik wygasł.','Customer Email'=>'Adres e-mail klienta','Tip: Upsells are products that are extra profitable or better quality or more expensive. Experiment with combinations to boost sales.'=>'Wskazówka: Upsells to produkty, które są bardziej opłacalne, lepszej jakości lub droższe. Eksperymentuj z kombinacjami, aby zwiększyć sprzedaż.','Upsells are typically products that are extra profitable or better quality or more expensive. Experiment with combinations to boost sales. %1$sLearn more about linked products%2$s'=>'Upsells to zazwyczaj produkty, które są bardziej opłacalne, lepszej jakości lub droższe. Eksperymentuj z kombinacjami, aby zwiększyć sprzedaż. %1$sDowiedz się więcej o powiązanych produktach%2$s','Include downloads'=>'Dołącz pliki do pobrania','Linked products'=>'Powiązane produkty','Logger'=>'Rejestrator','%1$s log file from source %2$s was deleted.'=>'Usunięto %1$s plik dziennika ze źródła %2$s.' . "\0" . 'Usunięto %1$s pliki dziennika ze źródła %2$s.' . "\0" . 'Usunięto %1$s plików dziennika ze źródła %2$s.','Logs settings'=>'Ustawienia logów','Logging is disabled. It can be enabled in <a href="%s">Logs Settings</a>.'=>'Logowanie jest wyłączone. Może być włączone w <a href="%s">ustawieniach logów</a>.','File system (default)'=>'Pliki (domyślne)','Database (not recommended on live sites)'=>'Baza danych (niezalecane w witrynach produkcyjnych)','Log storage'=>'Przechowywanie logów','This sets the minimum severity level of logs that will be stored. Lower severity levels will be ignored. "None" means all logs will be stored.'=>'Określa minimalny poziom ważności logów, które będą przechowywane. Niższe poziomy ważności zostaną zignorowanie. "Brak" oznacza, że wszystkie logi będą przechowywane.','Retention period'=>'Okres przechowywania','Level threshold'=>'Próg poziomu','This determines where log entries are saved.'=>'Określa gdzie logi są zapisywane.','This setting cannot be changed here because it is defined in the %s constant.'=>'To ustawienie nie może być tutaj zmienione, ponieważ jest zdefiniowane w stałej %s.','This setting cannot be changed here because it is defined in the %1$s constant, probably in your %2$s file.'=>'To ustawienie nie może być tutaj zmienione, ponieważ jest zdefiniowane w stałej %1$s, prawdopodobnie w pliku %2$s.','This sets how many days log entries will be kept before being auto-deleted.'=>'Ustala po ilu dniach logi zostaną automatycznie usunięte.','This setting cannot be changed here because it is being set by a filter on the %s hook.'=>'To ustawienie nie może być tutaj zmienione, ponieważ jest ustawiane przez filtr %s.','Note that if this setting is changed, any log entries that have already been recorded will remain stored in their current location, but will not migrate.'=>'Jeśli ta opcja zostanie zmieniona, wszelkie logi, które zostały już zarejestrowane, pozostaną w swojej obecnej lokalizacji i nie zostaną przeniesione.','No differences found.'=>'Nie znaleziono różnic.','Compatibility mode enabled?: %s'=>'Tryb zgodności włączony? %s','HPOS enabled?: %s'=>'Wydajne przechowywanie zamówień włączone? %s','Unsynced orders: %d'=>'Niesynchronizowane zamówienia: %d','Differences found for order %d:'=>'Znaleziono różnice dla zamówienia %d:','An error occurred while computing a diff for order %1$d: %2$s'=>'Wystąpił błąd podczas obliczania różnicy dla zamówienia %1$d: %2$s','Orders subject to cleanup: %d'=>'Zamówienia podlegające czyszczeniu: %d','A link to a product sold on a different website, e.g. brand collab.'=>'Odnośnik do produktu sprzedawanego na innej stronie internetowej, np. w ramach współpracy z marką.','Affiliate product'=>'Produkt partnerski','A set of products that go well together, e.g. camera kit.'=>'Zestaw produktów, które dobrze do siebie pasują, np. zestaw kamer.','A single physical or virtual product, e.g. a t-shirt or an eBook.'=>'Pojedynczy produkt fizyczny lub wirtualny, np. koszulka lub eBook.','Airwallex Payments'=>'Płatności Airwallex','Boost international sales and save on FX fees. Accept 60+ local payment methods including Apple Pay and Google Pay.'=>'Zwiększ sprzedaż międzynarodową i zaoszczędź na opłatach walutowych. Akceptuj ponad 60 lokalnych metod płatności, w tym Apple Pay i Google Pay.','Create a unique URL that applies a discount and optionally adds one or more products to the customer\'s cart.'=>'Utwórz unikatowy adres URL, który zastosuje zniżkę i opcjonalnie doda jeden lub klika produktów do koszyka klienta.','Create "store credit" coupons for customers which are redeemable at checkout.'=>'Twórz kupony „karta podarunkowa” dla klientów, które można wykorzystać podczas składania zamówienia.','Coupons for groups. Provides the option to have coupons that are restricted to group members or roles. Works with the free Groups plugin.'=>'Kupony dla grup. Zapewnia opcję posiadania kuponów, które są ograniczone do członków grupy lub ról. Działa z darmową wtyczką Groups.','Give away a free item to any customer with the coupon code.'=>'Rozdaj darmowy produkt każdemu klientowi z kodem kuponu.','Powerful, "all in one" solution for gift certificates, store credits, discount coupons and vouchers.'=>'Potężne rozwiązanie "wszystko w jednym" dla bonów podarunkowych, kredytów sklepowych, kuponów rabatowych i voucherów.','Generate dynamic personalized coupons for your customers that increase purchase rates.'=>'Generuj dynamiczne, spersonalizowane kupony dla swoich klientów, które zwiększą wskaźnik zakupów.','Integrate your WooCommerce store with 5000+ cloud apps and services today. Trusted by 11,000+ users.'=>'Już dziś zintegruj swój sklep WooCommerce z ponad 5000 aplikacji i usług w chmurze. Zaufało nam już ponad 11 000 użytkowników.','Harness data from WooCommerce to grow your business. Manage leads, customers, and segments, through automation, quotes, invoicing, billing, and email marketing. Power up your store with CRM.'=>'Wykorzystaj dane z WooCommerce do rozwoju swojej firmy. Zarządzaj leadami, klientami i segmentami poprzez automatyzację, wyceny, fakturowanie, rozliczenia i e-mail marketing. Wzmocnij swój sklep dzięki CRM.','Turn your product images into stunning videos that engage and convert audiences - no video experience required.'=>'Przekształć zdjęcia swoich produktów w oszałamiające filmy, które angażują i konwertują odbiorców - nie jest wymagane doświadczenie wideo.','Collect and showcase verified reviews that consumers trust.'=>'Zbieraj i prezentuj zweryfikowane recenzje, którym ufają konsumenci.','Delight customers and boost organic sales with a special WooCommerce birthday email (and coupon!) on their special day.'=>'Zachwyć klientów i zwiększ sprzedaż organiczną dzięki specjalnemu urodzinowemu e-mailowi WooCommerce (i kuponowi!) w ich wyjątkowy dzień.','Sync your website\'s data like contacts, products, and orders over Salesforce CRM with Salesforce Integration for WooCommerce.'=>'Synchronizuj dane swojej witryny internetowej, takie jak kontakty, produkty i zamówienia za pośrednictwem Salesforce CRM dzięki integracji Salesforce dla WooCommerce.','Automations'=>'Automatyzacje','Sales channels'=>'Kanały sprzedażowe','Conversion'=>'Konwersja','CRM'=>'CRM','Send targeted campaigns, recover abandoned carts and more with Mailchimp.'=>'Wysyłaj ukierunkowane kampanie, odzyskuj porzucone koszyki i więcej dzięki Mailchimp.','Boost your organic sales by adding a customer referral program to your WooCommerce store.'=>'Zwiększ swoją sprzedaż organiczną, dodając program poleceń klientów do swojego sklepu WooCommerce.','Convert and retain customers with automated marketing that does the hard work for you.'=>'Konwertuj i zatrzymuj klientów dzięki zautomatyzowanemu marketingowi, który wykona ciężką pracę za ciebie.','Create advertising campaigns and reach one billion global users with TikTok for WooCommerce.'=>'Twórz kampanie reklamowe i docieraj do miliarda użytkowników na całym świecie dzięki TikTok dla WooCommerce.','Override the "woocommerce_date_type" option that is used for the database date field considered for revenue reports.'=>'Zastąp opcję "woocommerce_date_type", która jest używana dla pola daty bazy danych uwzględnianego w raportach przychodów.','Sorry, you cannot create dummy products.'=>'Niestety, nie możesz tworzyć fikcyjnych produktów.','Sales of the marketing campaign.'=>'Sprzedaż kampanii marketingowej.','Limit result set to specific amount of suggested products.'=>'Ogranicz zestaw wyników do określonej liczby sugerowanych produktów.','Limit result set to specific product tag ids.'=>'Ogranicz zestaw wyników do określonych identyfikatorów tagów produktów.','Limit result set to specific product categorie ids.'=>'Ogranicz zestaw wyników do określonych identyfikatorów kategorii produktów.','Invalid layout template ID.'=>'Nieprawidłowy identyfikator szablonu układu.','Area to get templates for.'=>'Obszar, dla którego możesz pobrać szablony.','The downloadable file %s cannot be used as it does not exist on the server, or is not located within an approved directory. Please contact a site administrator for help. %2$sLearn more.%3$s'=>'Nie można użyć pliku %s do pobrania, ponieważ nie istnieje on na serwerze lub nie znajduje się w zatwierdzonym katalogu. Skontaktuj się z administratorem witryny, aby uzyskać pomoc. %2$sDowiedz się więcej.%3$s','Grow your business on Pinterest! Use this official plugin to allow shoppers to Pin products while browsing your store, track conversions, and advertise on Pinterest.'=>'Rozwijaj swoją działalność na Pintereście! Skorzystaj z tej oficjalnej wtyczki, aby umożliwić kupującym, którzy przeglądają twój sklep, oznaczanie produktów pinami, a także aby śledzić konwersje i reklamować się na Pintereście.','Could not start the installation process. Reason: '=>'Nie można rozpocząć procesu instalacji. Powód: ','block titleProduct list'=>'Lista produktów','block descriptionEnable customers to filter the product collection by rating.'=>'Pozwól klientom filtrować kolekcję produktów według oceny.','block descriptionThe product list.'=>'Lista produktów.','block descriptionThe product section description.'=>'Opis sekcji produktu.','block titleProduct section description'=>'Opis sekcji produktu','Order not found.'=>'Nie znaleziono zamówienia.','Match images'=>'Dopasowuj obrazki','Product image matching by SKU'=>'Do