 Please have a look and update it to fit your store.'=>'Stworzyliśmy dla ciebie szkic przykładowej strony Polityki zwrotów. Dostosuj jej treść tak, aby pasowała do twojego sklepu.','Billing Phone Number'=>'Numer telefonu płatności','Shipping Phone Number'=>'Numer telefonu wysyłki','Enable table usage'=>'Włącz użycie tabeli','Product attributes lookup table'=>'Tabela do wyszukiwania atrybutów produktu','These settings are not available while the lookup table regeneration is in progress.'=>'Te opcje nie są dostępne w trakcie procesu odnawiania tabeli.','Use the product attributes lookup table for catalog filtering.'=>'Używaj tabeli do wyszukiwania atrybutów produktu do filtrowania katalogu.','Select a product to regenerate the data for, or leave empty for a full table regeneration:'=>'Wybierz produkt do odnowienia danych lub pozostaw pole puste, aby odnowić całą tabelę:','Page slugrefund_returns'=>'zwroty','Additional data to pass to the extension'=>'Dodatkowe dane do przekazania do rozszerzenia','Extension\'s name - this will be used to ensure the data in the request is routed appropriately.'=>'Nazwa rozszerzenia – zostanie użyta, aby upewnić się, że dane z żądania są przekierowane.','N. Revenue (formatted)'=>'Przychód netto (sformatowany)','Net total revenue (formatted).'=>'Całkowity przychód netto (sformatowany).','When true, refunded items are restocked.'=>'Jeśli "true", stan magazynowy zwróconych pozycji jest przywrócony.','Enable WooCommerce Analytics'=>'Włącz Analitykę WooCommerce','Setup a Refund and Returns Policy page to boost your store\'s credibility.'=>'Skonfiguruj stronę Polityki zwrotów, aby zwiększyć wiarygodność twojego sklepu.','Limit result set to products that are low or out of stock. (Deprecated)'=>'Ogranicz wyniki do produktów, które mają niski stan magazynowy, lub brak ich w magazynie. (Przestarzałe)','%1$s could not be served using the X-Accel-Redirect/X-Sendfile method. A Force Download will be used instead.'=>'Nie można było obsłużyć %1$s za pomocą metody X-Accel-Redirect/X-Sendfile. W zamian zostanie użyte wymuszenie pobierania.','%1$s could not be served using the Force Download method. A redirect will be used instead.'=>'Nie można było obsłużyć %1$s za pomocą metody wymuszenia pobierania. W zamian zostanie użyte przekierowanie.','If the "Force Downloads" or "X-Accel-Redirect/X-Sendfile" download method is selected but does not work, the system will use the "Redirect" method as a last resort. <a href="%1$s">See this guide</a> for more details.'=>'Jeśli wybrano metodę pobierania "Wymuszaj pobieranie" lub "X-Accel-Redirect/X-Sendfile", ale nie będzie ona działać, system użyje w ostateczności metody "Tylko przekierowanie". <a href="%1$s">Zobacz ten przewodnik</a>, aby uzyskać więcej informacji.','Allow using redirect mode (insecure) as a last resort'=>'Zezwól na użycie przekierowania jako ostateczność (niebezpieczne)','Choose payment providers and enable payment methods at checkout.'=>'Wybierz pośredników i włącz metody płatności na stronie zamówienia.','Set your store location and where you\'ll ship to.'=>'Ustaw lokalizację swojego sklepu i miejsca, do których będziesz wysyłać.','You\'re only one step away from getting paid. Verify your business details to start managing transactions with WooPayments.'=>'Już tylko krok dzieli cię od otrzymywania płatności. Zweryfikuj dane swojej firmy, aby rozpocząć zarządzanie transakcjami za pomocą WooPayments.','Start by adding the first product to your store. You can add your products manually, via CSV, or import them from another service.'=>'Zacznij od dodania pierwszego produktu do sklepu. Możesz dodać swoje produkty ręcznie, przez CSV lub zaimportować je z innej usługi.','Your store address is required to set the origin country for shipping, currencies, and payment options.'=>'Adres twojego sklepu jest wymagany, żeby ustawić kraj wysyłki, waluty i opcje płatności.','Grow your store'=>'Rozwijaj swój sklep','Get backups'=>'Skorzystaj z kopii zapasowych','Protect y