brania','Things to do next'=>'Następne kroki','Manage transactions without leaving your WordPress Dashboard. Only with WooPayments.'=>'Zarządzaj transakcjami bez opuszczania swojego kokpitu WordPress. Tylko z WooPayments.','A link to a product category.'=>'Link do kategorii produktu.','A link to a product tag.'=>'Link do tagu produktu.','A link to a product.'=>'Link do produktu.','Create and send purchase follow-up emails, newsletters, and promotional campaigns straight from your dashboard.'=>'Twórz i wysyłaj e-maile uzupełniające, newslettery i kampanie promocyjne bezpośrednio z kokpitu.','How easy was it to add a product tag?'=>'Jak łatwo było dodać tag produktu?','Invalid path provided.'=>'Podano nieprawidłową ścieżkę.','Product Category Link'=>'Link kategorii produktu','Product Link'=>'Link produktu','Product Tag Link'=>'Link tagu produktu','To ensure your store&rsquo;s notifications arrive in your and your customers&rsquo; inboxes, we recommend connecting your email address to your domain and setting up a dedicated SMTP server. If something doesn&rsquo;t seem to be sending correctly, install the <a href="%1$s">WP Mail Logging Plugin</a> or check the <a href="%2$s">Email FAQ page</a>.'=>'Aby mieć pewność, że powiadomienia ze sklepu dotrą do skrzynek pocztowych klientów, zalecamy połączenie adresu e-mail z domeną i skonfigurowanie dedykowanego serwera SMTP. Jeśli coś wydaje się nie wysyłać poprawnie, zainstaluj <a href="%1$s">wtyczkę WP Mail Logging</a> lub sprawdź <a href="%2$s">stronę E-mail FAQ</a>.','Delta Amacuro'=>'Delta Amacuro','Federal Dependencies'=>'Federal Dependencies','Zulia'=>'Zulia','Yaracuy'=>'Yaracuy','Trujillo'=>'Trujillo','Táchira'=>'Táchira','Sucre'=>'Sucre','Portuguesa'=>'Portuguesa','Nueva Esparta'=>'Nueva Esparta','Monagas'=>'Monagas','Miranda'=>'Miranda','Mérida'=>'Mérida','Lara'=>'Lara','Guárico'=>'Guárico','Falcón'=>'Falcón','Cojedes'=>'Cojedes','Carabobo'=>'Carabobo','Bolívar'=>'Bolívar','Barinas'=>'Barinas','Aragua'=>'Aragua','Apure'=