odes / ZIPs. Introduced in WooCommerce 5.3.'=>'Lista kodów pocztowych. Wprowadzone w WooCommerce 5.3.','Tax class slug is invalid'=>'Uproszczona nazwa klasy podatkowej jest nieprawidłowa','Search for a page&hellip;'=>'Szukaj strony&hellip;','Low Stock amount for the product.'=>'Niski stan magazynowy dla tego produktu.','Low Stock amount for the variation.'=>'Niski stan magazynowy dla tego wariantu.','Postcode/ZIP, it doesn\'t support multiple values. Deprecated as of WooCommerce 5.3, \'postcodes\' should be used instead.'=>'Pole Kod pocztowy nie wspiera wartości wielokrotnych. Zostało to uznane za przestarzałą praktykę w WooCommerce 5.3. Zamiast tego użyj pola \'postcodes\'.','City name, it doesn\'t support multiple values. Deprecated as of WooCommerce 5.3, \'cities\' should be used instead.'=>'Pole Miasto nie wspiera wartości wielokrotnych. Zostało to uznane za przestarzałą praktykę w WooCommerce 5.3. Zamiast tego użyj pola \'cities\'.','Additional tax class "%1$s" couldn\'t be saved. %2$s.'=>'Nie udało się zapisać dodatkowej klasy podatkowej "%1$s". %2$s.','Offset the result set by a specific number of items. Applies to hierarchical taxonomies only.'=>'Przesuń wyniki o określoną liczbę pozycji. Dotyczy tylko taksonomii hierarchicznych.','Limit result set to resources assigned to a specific parent. Applies to hierarchical taxonomies only.'=>'Ogranicz zestaw wyników do zasobów przypisanych do danego elementu nadrzędnego. Dotyczy tylko taksonomii hierarchicznych.','Amount that will be refunded for this tax.'=>'Kwota do zwrotu dla tego podatku.','Amount that will be refunded for this line item (excluding taxes).'=>'Kwota do zwrotu dla tej pozycji (bez podatku).','When variation stock reaches this amount you will be notified by email. The default value for all variations can be set in the product Inventory tab. The shop default value can be set in Settings > Products > Inventory.'=>'Gdy stan magazynowy wariantu osiągnie tę liczbę dostaniesz powiadomienie e-mailem. Istn