nctionality may not work as expected.'=>'Brakujące tabele bazy danych: %s. Niektóre funkcje WooCommerce mogą nie działać prawidłowo.','Database tables missing'=>'Brak tabel w bazie danych','One or more tables required for WooCommerce to function are missing, some features may not work as expected. Missing tables: %1$s. <a href="%2$s">Check again.</a>'=>'Brakuje co najmniej jednej tabeli niezbędnej do działania wtyczki WooCommerce. Niektóre funkcje mogą nie działać poprawnie. Brakujące tabele: %1$s. <a href="%2$s">Sprawdź ponownie.</a>','Home'=>'Strona główna','Take payments with the provider that’s right for you - choose from 100+ payment gateways for WooCommerce.'=>'Przyjmuj płatności z dostawcą odpowiednim dla ciebie - wybierz z ponad 100 bramek płatniczych dla WooCommerce.','Marketplace'=>'Sklep z rozszerzeniami','Overview'=>'Przegląd','Start accepting payments on your store!'=>'Rozpocznij przyjmowanie płatności w swoim sklepie!','Install plugins'=>'Zainstaluj wtyczki','We noticed that there was a problem during the Jetpack and WooCommerce Shipping & Tax install. Please try again and enjoy all the advantages of having the plugins connected to your store! Sorry for the inconvenience. The "Jetpack" and "WooCommerce Shipping & Tax" plugins will be installed & activated for free.'=>'Wykryliśmy problem podczas instalacji Jetpacka i WooCommerce Shipping & Tax. Proszę spróbować ponownie, aby skorzystać ze wszystkich zalet tych rozwiązań. Wtyczki "Jetpack" i "WooCommerce Shipping & Tax" zostaną zainstalowane i włączone za darmo.','Uh oh... There was a problem during the Jetpack and WooCommerce Shipping & Tax install. Please try again.'=>'Ojej... Wystąpił problem podczas instalacji Jetpack i WooCommerce Shipping & Tax. Spróbuj ponownie.','Zambézia'=>'Zambézia','Tete'=>'Tete','Sofala'=>'Sofala','Niassa'=>'Niassa','Nampula'=>'Nampula','Maputo'=>'Maputo','Maputo Province'=>'Maputo Province','Manica'=>'Manica','Inhambane'=>'Inhambane','Gaza'=>'Gaza','Cabo Delgado'=>'Cabo Delg