ooCommerce, skorzystaj z <a href="%1$s">forum społeczności</a>. Aby uzyskać pomoc dotyczącą rozszerzeń premium sprzedawanych na WooCommerce.com, <a href="%2$s">poproś o wsparcie na WooCommerce.com</a>.','Installed version not tested with active version of WooCommerce %s'=>'Zainstalowana wersja nie została przetestowana z włączoną wersją WooCommerce %s','If checked, free shipping would be available based on pre-discount order amount.'=>'Jeśli zaznaczone, bezpłatna wysyłka będzie dostępna na podstawie kwoty zamówienia przed rabatem.','Apply minimum order rule before coupon discount'=>'Zastosuj regułę minimalnego zamówienia sprzed użycia kuponu zniżkowego','Please visit the <a href="%s" target="_blank">subscriptions page</a> and renew to continue receiving updates.'=>'Proszę przejść do <a href="%s" target="_blank">strony subskrypcji</a>, aby odnowić subskrypcję i otrzymywać aktualizacje.','Visit WooCommerce.com to learn more about <a href="%1$s" target="_blank">getting started</a>.'=>'Przejdź na stronę WooCommerce.com aby dowiedzieć się więcej <a href="%1$s" target="_blank">jak zacząć</a>.','Personalize homepage'=>'Dostosuj stronę główną','Personalize your store\'s homepage'=>'Dostosuj stronę główną sklepu','The plugin could not be activated.'=>'Nie można włączyć wtyczki.','Limit stats fields to the specified items.'=>'Ogranicz pola statystyk do określonych elementów.','Shipping Label'=>'Etykieta wysyłkowa','The homepage is one of the most important entry points in your store. When done right it can lead to higher conversions and engagement. Don\'t forget to personalize the homepage that we created for your store during the onboarding.'=>'Strona główna jest jednym z najważniejszych punktów w witrynie. Dobrze wykonana może zwiększyć konwersje i zaangażowanie. Nie zapomnij o spersonalizowaniu strony głównej, którą stworzyliśmy dla twojego sklepu podczas procesu instalacji.','Securely accept credit and debit cards on your site. Manage transactions without leaving your WordPress dashboard. Only with <strong>WooPayments</strong>.'=>'Bezpiecznie akceptuj płatności katami kredytowymi i debetowymi. Zarządzaj transakcjami z poziomu kokpitu WooCommerce. Działa tylko z <strong>WooPayments</strong>.','There was an error communicating with the WooPayments plugin.'=>'Wystąpił błąd w komunikacji z wtyczką WooPayments.','Try the new way to get paid'=>'Wypróbuj nowy sposób płatności','It appears one or more database tables were missing. Attempting to re-create the missing table(s).'=>'Wygląda na to, że w bazie danych brakuje co najmniej jednej wymaganej tabeli. Próbuję odtworzyć brakujące tabele.','Your store is configured to serve digital products using "Redirect only" method. This method is deprecated, <a href="%s">please switch to a different method instead.</a><br><em>If you use a remote server for downloadable files (such as Google Drive, Dropbox, Amazon S3), you may optionally wish to "allow using redirects as a last resort". Enabling that and/or selecting any of the other options will make this notice go away.</em>'=>'Twój sklep jest skonfigurowany do obsługi produktów wirtualnych przy użyciu metody "Tylko przekierowanie". Ta metoda jest przestarzała, <a href="%s">zamiast tego przełącz się na inną.</a><br><em>Jeśli do pobierania plików używasz zdalnego serwera (na przykład Dysk Google, Dropbox, Amazon S3), właściwa metoda zostanie zastosowana automatycznie, więc wybierz dowolną inną opcję, aby pozbyć się tego powiadomienia.</em>','Get started'=>'Rozpocznij','Choose theme'=>'Wybierz motyw','Mobile app'=>'Aplikacja mobilna','Send targeted campaigns, recover abandoned carts and much more with Mailchimp.'=>'Wysyłaj kampanie reklamowe, odzyskaj porzucone koszyki i wiele więcej dzięki Mailchimp.','Set up payments'=>'Skonfiguruj płatności','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place.'=>'Akceptuj płatności kartami płatniczy