amówień i sprawdź zamówienia według daty.','Congratulations on getting your first order! Now is a great time to learn how to manage your orders.'=>'Gratulacje, pojawiło się pierwsze zamówienie! To dobry czas na naukę zarządzania zamówieniami.','Activate usage tracking'=>'Włącz statystyki użytkowania','You\'ve hit the 10 orders milestone! Look at you go. Browse some WooCommerce success stories for inspiration.'=>'Osiągnąłeś próg 10 zamówień! Dobrze ci idzie. Przejrzyj historie sukcesu sklepów opartych o WooCommerce, aby zdobyć inspiracje.','Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the %1$sSettings%3$s and choose to stop sharing data. %2$sRead more%3$s about what data we collect.'=>'Zbieranie danych użytkowania pozwala nam rozwijać WooCommerce. Twój sklep będzie brany pod uwagę podczas oceny nowych funkcjonalności, oceny jakości aktualizacji, i decyzji czy poprawki są sensowne. W każdym momencie możesz przejść do %1$sUstawień%3$s i wyłączyć dzielenie się danymi. %2$sDowiedz się więcej%3$s na temat danych, które zbieramy.','Woohoo, %1$s was your record day for sales! Net sales was %2$s beating the previous record of %3$s set on %4$s.'=>'Super! %1$s był rekordowym dniem sprzedaży! Sprzedaż netto wyniosła %2$s pokonując poprzedni rekord %3$s z dnia %4$s.','Default Date Range'=>'Domyślny zakres dat','Statuses that require extra action on behalf of the store admin.'=>'Statusy wymagające dodatkowych działań ze strony administratora sklepu.','Report table data is being deleted.'=>'Dane tabeli raportów są usuwane.','Statuses that should not be included when calculating report totals.'=>'Statusy, które nie powinny być brane pod uwagę podczas obliczania sum w raportach.','Actionable order statuses'=>'Statusy zamówień wywołujące akcje','The admin note name prop cannot be empty.'=>'Nazwa notatki administratora ni