Class.','Database error.'=>'Błąd bazy danych.','%1$s &lsaquo; %2$s'=>'%1$s &lsaquo; %2$s','Stopped the insanity for %d second'=>'Zatrzymano szaleństwo na %d sekundę' . "\0" . 'Zatrzymano szaleństwo na %d sekundy' . "\0" . 'Zatrzymano szaleństwo na %d sekund','The next queue will begin processing in approximately %d seconds.'=>'Następna kolejka rozpocznie przetwarzanie za około %d sekund.','Excluded report order statuses'=>'Wykluczone z raportów statusy zamówień','Invalid value for select or count parameter. Cannot query actions.'=>'Niepoprawna wartość parametru select lub count. Nie można wykonać zapytania.','%s Support for strings longer than this will be removed in a future version.'=>'%s Obsługa ciągów dłuższych niż ten zostanie usunięta w przyszłej wersji.','Settings for WooCommerce admin reporting.'=>'Ustawienia raportów administratora WooCommerce.','A new queue has begun processing. <a href="%s">View actions in-progress &raquo;</a>'=>'Rozpoczęto przetwarzanie nowej kolejki. <a href="%s">Zobacz akcje w trakcie realizacji &raquo;</a>','Unknown status found for action.'=>'Znaleziono nieznany status akcji.','action started via %s'=>'akcja rozpoczęta przez %s','action ignored via %s'=>'akcja ignorowana przez %s','action failed via %1$s: %2$s'=>'nie powiodła się akcja przez %1$s: %2$s','action complete via %s'=>'akcja zakończona przez %s','Action [%1$s] has an invalid schedule: %2$s'=>'Czynność [%1$s] ma nieprawidłowy harmonogram: %2$s','There was a failure fetching this action: %s'=>'Wystąpił błąd pobierania tego działania: %s','ActionScheduler_Action::$args too long. To ensure the args column can be indexed, action args should not be more than %d characters when encoded as JSON.'=>'ActionScheduler_Action::$args za długi. Aby zapewnić możliwość indeksowania kolumny argumentów, argumenty działania nie powinny mieć więcej niż %d znaków, gdy są kodowane jako JSON.','Activity log for the action.'=>'Dziennik aktywności wykonanych działań.','There was a failure scheduling the next instance of this action: %s'=>'Wystąpił błąd podczas planowania następnego wykonania akcji: %s','Name of the action hook that will be triggered.'=>'Nazwa haka akcji, który zostanie wyzwolony.','Optional action group.'=>'Opcjonalna grupa akcji.','The action\'s schedule frequency.'=>'Częstotliwość harmonogramu akcji.','Action Scheduler is a scalable, traceable job queue for background processing large sets of actions. Action Scheduler works by triggering an action hook to run at some time in the future. Scheduled actions can also be scheduled to run on a recurring schedule.'=>'Action Scheduler to skalowalna, identyfikowalna kolejka zadań do przetwarzania w tle dużych zestawów działań. Harmonogram akcji jest wyzwalany do uruchomienia w przyszłości. Zaplanowane działania można również zaplanować tak, aby były uruchamiane cyklicznie.','Scheduled Action Columns'=>'Kolumny zaplanowanych akcji','Optional data array passed to the action hook.'=>'Opcjonalna tablica danych przekazana do akcji.','Action statuses are Pending, Complete, Canceled, Failed'=>'Statusy akcji to: oczekująca, zakończona, anulowana i nieudana','Scheduled'=>'Zaplanowano','The date/time the action is/was scheduled to run.'=>'Data/godzina uruchomienia zaplanowanego działania.','About'=>'Informacje','Migrating %d action'=>'Migrowanie %d akcji' . "\0" . 'Migrowanie %d akcji' . "\0" . 'Migrowanie %d akcji','Unable to remove source migrated action %s'=>'Nie można usunąć źródła migrowanej akcji%s','Action Scheduler migration in progress. The list of scheduled actions may be incomplete.'=>'Trwa migracja harmonogramu akcji. Lista zaplanowanych akcji może być niekompletna.','About Action Scheduler %s'=>'O harmonogramie akcji %s','Migrated action with ID %1$d in %2$s to ID %3$d in %4$s'=>'Migracja akcji o identyfikatorze %1$d w %2$s do identyfikatora %3$d w %4$s','Filename'=>'Nazwa pliku','This data will be deleted in %s.'=>'Te dane zostaną usunięte: %s.','Version:'=>'Wersja:','Items Subtotal:'=>'Suma poz