ms in this attribute are sorted by default.'=>'Jak są domyślnie posortowane taksonomie dla tego atrybutu.','Database File Path'=>'Ścieżka do pliku bazy danych','Invalid product type: passed ID does not correspond to a product variation.'=>'Nieprawidłowy typ produktu: podany identyfikator nie odpowiada wariantowi produktu.','You cannot add a new payment method so soon after the previous one. Please wait for %d second.'=>'Nie można dodać nowej metody płatności tak szybko po poprzedniej. Proszę poczekać %d sekundę.' . "\0" . 'Nie można dodać nowej metody płatności tak szybko po poprzedniej. Proszę poczekać %d sekundy.' . "\0" . 'Nie można dodać nowej metody płatności tak szybko po poprzedniej. Proszę poczekać %d sekund.','Please enter a value with one decimal point (%s) without thousand separators.'=>'Wprowadź z jednym miejscem po przecinku (%s) bez innych separatorów.','Missing MaxMind Reader library!'=>'Brakująca biblioteka MaxMind Reader!','MaxMind License Key'=>'Klucz licencyjny MaxMind','The key that will be used when dealing with MaxMind Geolocation services. You can read how to generate one in <a href="%1$s">MaxMind Geolocation Integration documentation</a>.'=>'Klucz, który zostanie użyty do integracji z usługami lokalizacji MaxMind. Dowiedz się jak go wygenerować z <a href="%1$s">dokumentacji integracji MaxMind</a>.','Learn more about how usage tracking works, and how you\'ll be helping in our <a href="%1$s" target="_blank">usage tracking documentation</a>.'=>'Dowiedz się więcej na temat działania opcji śledzenia i w jaki sposób możesz pomóc w <a href="%1$s" target="_blank">naszej dokumentacji</a>.','An unexpected error happened while applying the Coupon %s.'=>'Wystąpił niespodziewany błąd podczas realizacji kuponu %s.','Failed to download the MaxMind database.'=>'Pobieranie bazy danych MaxMind nie powiodło się.','Coupon %s was used in another transaction during this checkout, and coupon usage limit is reached. Please remove the coupon and try again.'=>'Podczas