niasz dane i w jakim celu to robisz. Lista może zawierać w szczególności usługi analityczne, marketingowe, bramki płatności, kurierów oraz osadzone treści.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Dzielimy się informacjami z podmiotami trzecimi, które pomagają nam w realizacji zamówień i świadczeniu usług sklepowych; na przykład --','Customer information like your name, email address, and billing and shipping information.'=>'Informacje o klientach, takie jak imię i nazwisko, adres e-mail i informacje dotyczące fakturowania i wysyłki.','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Członkowie naszego zespołu mają dostęp do informacji, które nam podajesz. Np. administratorzy i obsługa sklepu mają dostęp do:','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Szczegóły zamówień, takie jak kupione pozycje, data zamówienia, adres wysyłki i','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Nasz zespół ma dostęp do tych informacji, aby obsługiwać zamówienia, zwroty oraz oferować wsparcie.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Ogólnie informacje są przechowywane tak długo, jak potrzebujemy informacji dla celów, dla których je gromadzimy i wykorzystujemy, i nie jesteśmy prawnie zobowiązani do dalszego przechowywania. Na przykład przechowujemy informacje o zamówieniach przez XXX lat dla celów podatkowych i księgowych. Obejmuje to imię i nazwisko, adres e-mail oraz adresy.','We will also store comments or reviews, if you choose to leave them.'=>'Będziemy również przechowywać komentarze i opinie, jeśli zdecydujesz się je napisać.','What we share with others'=>'Co dzielimy z innymi','Who on our team has access'=>'Kto w naszym zespole ma dostęp','Comply with any legal obligations we have, such as calculating taxes'=>'Spełnienie zobowiązań prawnych, np. obliczania podatków','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Jeśli utworzysz konto, zachowamy twoje imię i nazwisko, adres, e-mail oraz numer telefonu, które będą wykorzystane przy składaniu następnych zamówień.','Improve our store offerings'=>'Ulepszanie oferty sklepu','Process payments and prevent fraud'=>'Procesowanie płatności i zapobieganie oszustwom','Respond to your requests, including refunds and complaints'=>'Odpowiadanie na twoje zgłoszenia, w tym zwroty i reklamacje','Send you information about your account and order'=>'Przesyłanie informacji o twoim koncie i zamówieniach','Send you marketing messages, if you choose to receive them'=>'Wysyłanie informacji marketingowych, jeśli zgodzisz się na ich otrzymywanie','Set up your account for our store'=>'Założenie konta w naszym sklepie','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Gdy kupujesz w naszym sklepie, poprosimy cię o podanie informacji zawierających imię i nazwisko, adresy płatności i wysyłki, e-mail, telefon, dane płatności lub karty i opcjonalne dane konta: nazwa użytkownika i hasło. Będziemy wykorzystywać te informacje w poniższych celach:','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Uwaga: możesz uszczegółowić swoje zasady dotyczące plików cookie i dodać link do tej sekcji w tym miejscu.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Będziemy również używać plików cookie do śledzenia zawartości koszyka podczas przeglądania naszej witryny.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Adres wysyłki: poprosimy cię o wpisanie adresu, abyśmy mogli na przykład oszacować koszty wysyłki przed złożeniem zamówienia i wysłać zamówienie!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Lokalizacja, adres IP i przeglądarka: użyjemy tych danych do oszacowania podatków i kosztów wysyłki','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Przeglądane produkty: użyjemy tych informacji, aby na przykład pokazać ci ostatnio oglądane produkty','We collect information about you during the checkout process on our store.'=>'Zbieramy informacje o tobie podczas składania zamówienia w naszym sklepie.','What we collect and store'=>'Jakie informacje zbieramy i przechowujemy','While you visit our site, we’ll track:'=>'Podczas przeglądania naszej witryny, będziemy zbierać następujące informacje:','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Ten przykładowy tekst zawiera podstawowe informacje o zbieraniu, przechowywaniu i udostępnianiu danych oraz kto może mieć do nich dostęp. Te informacje mogą się zmienić w zależności od ustawień lub dodatkowych wtyczek. Rekomendujemy zasięgnięcie opinii prawnika w sprawie polityki prywatności.','Order Number'=>'Numer zamówienia','Items Purchased'=>'Zakupione pozycje','Access granted'=>'Dostęp przyznany','Download count'=>'Liczba pobrań','Browser User Agent'=>'User Agent przeglądarki','Payment Tokens'=>'Tokeny płatności','Token'=>'Token','User email'=>'Adres e-mail użytkownika','display name%1$s %2$s'=>'%1$s %2$s','%1$s has been removed from your cart because it has since been modified. You can add it back to your cart <a href="%2$s">here</a>.'=>'%1$s został usunięty z twojego koszyka ponieważ został w międzyczasie zmodyfikowany. Możesz dodać go do koszyka ponownie <a href="%2$s">tutaj</a>.','Cloning is forbidden.'=>'Klonowanie jest niedozwolone.','Your store does not appear to be using a secure connection. We highly recommend serving your entire website over an HTTPS connection to help keep customer data secure. <a href="%s">Learn more here.</a>'=>'Wygląda na to, że twój sklep nie korzysta z bezpiecznego połączenia. Rekomendujemy przesyłanie danych witryny za pomocą połączenia HTTPS, aby lepiej chronić dane użytkowników. <a href="%s">Dowiedz się więcej.</a>','optional'=>'opcjonalne','Display name cannot be changed to email address due to privacy concern.'=>'Nazwa wyświetlana nie może być zmieniona na adres e-mail ze względu na ochronę prywatności.','User roleCustomer'=>'Klient','User roleShop manager'=>'Kierownik sklepu','Phone Number'=>'Numer telefonu','Billing Postal/Zip Code'=>'Kod pocztowy płatności','Billing State'=>'Stan płatności','Shipping First Name'=>'Imię wysyłki','Shipping Last Name'=>'Nazwisko wysyłki','Shipping Company'=>'Firma wysyłki','Shipping City'=>'Miasto wysyłki','Shipping Postal/Zip Code'=>'Kod pocztowy wysyłki','Customer Data'=>'Dane klienta','Blog id of the record on the multisite.'=>'ID witryny dla tego elementu.','URL to edit the order'=>'Adres URL edycji zamówienia','Name of the customer for the order'=>'Nazwa klienta dla zamówienia','Order total formatted for locale'=>'Suma zamówienia sformatowana według ustawień jęz