kosza po określonym czasie.','Retain cancelled orders'=>'Zachowaj anulowane zamówienia','Retain completed orders'=>'Zachowaj zrealizowane zamówienia','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Zachowaj zrealizowane zamówienia przez określony czas przed anonimizacją danych.','Retain failed orders'=>'Zachowaj nieudane zamówienia','Displays whether or not WordPress is using an external object cache.'=>'Wyświetla, czy WordPress używa zewnętrznej pamięci podręcznej obiektów.','External object cache'=>'Zewnętrzna pamięć podręczna obiektów','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Anulowane zamówienia są nieopłacone i mogły być anulowane przez właściciela sklepu lub klienta. Zostaną przeniesione do kosza po określonym czasie.','Privacy policy'=>'Polityka prywatności','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Twoje dane osobowe zostaną użyte do obsługi twojej wizyty na naszej stronie, zarządzania dostępem do twojego konta i dla innych celów o których mówi nasza %s.','Allowed emails'=>'Dozwolone e-maile','Use previous column mapping preferences?'=>'Użyć poprzednich ustawień mapowania kolumn?','Remove personal data'=>'Usuń dane osobowe','Registration privacy policy'=>'Polityka prywatności rejestracji','Optionally add some text about your store privacy policy to show on account registration forms.'=>'Opcjonalnie dodaj informacje na temat polityki prywatności sklepu, aby wyświetlić go w formularzu rejestracji konta.','Checkout privacy policy'=>'Polityka prywatności zamówień','Optionally add some text about your store privacy policy to show during checkout.'=>'Opcjonalnie dodaj informacje na temat polityki prywatności sklepu, aby wyświetlić go podczas składania zamówienia.','Accounts &amp; Privacy'=>'Konta i prywatność','Account erasure requests'=>'Prośby o usunięcie kont','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Wybierz jak długo przechowywać dane osobowe, jeśli nie są już używane do realizacji zamówień. Pozostaw puste pole, aby nigdy nie usuwać danych.','Personal data retention'=>'Zachowywanie danych osobowych','Retain inactive accounts '=>'Zachowaj nieaktywne konta ','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Nieaktywne konta to takie, na które nie było logowania lub zamówień przez określony czas. Zostaną one usunięte. Zamówienia zostaną skonwertowane na zamówienia gości.','privacy page'=>'strona prywatności','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'Ta sekcja odpowiada za wyświetlanie polityki prywatności twojej witryny. Komunikaty dotyczące prywatności nie będą wyświetlane dopóki %s nie zostanie utworzona.','Filter by registered customer'=>'Filtruj wg zarejestrowanego klienta','List of allowed billing emails to check against when an order is placed. Separate email addresses with commas. You can also use an asterisk (*) to match parts of an email. For example "*@gmail.com" would match all gmail addresses.'=>'Lista dozwolonych adresów e-mail sprawdzanych z adresem e-mail klienta. Oddziel adresy przecinkami. Możesz też użyć gwiazdki (*), aby zastąpić części adresu e-mail. Np. "*@gmail.com" będzie miało zastosowanie do wszystkich adresów w domenie gmail.com.','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Twoje dane osobowe będą użyte do przetworzenia zamówienia, ułatwienia korzystania ze strony internetowej oraz innych ce