old'=>'Zmień status na wstrzymane','Change status to processing'=>'Zmień status na w trakcie realizacji','Create your first coupon'=>'Utwórz pierwszy kupon','Existing products that match by ID or SKU will be updated. Products that do not exist will be skipped.'=>'Istniejące produkty z poprawnym ID lub SKU zostaną zaktualizowane. Produkty, które nie istnieją zostaną pominięte.','To receive updates and support for this extension, you need to <strong>purchase</strong> a new subscription or consolidate your extensions to one connected account by <strong><a href="%1$s" title="Sharing Docs">sharing</a> or <a href="%2$s" title="Transferring Docs">transferring</a></strong> this extension to this connected account.'=>'Aby otrzymywać aktualizacje i pomoc techniczną dla tego rozszerzenia, musisz <strong>kupić</strong> nową subskrypcję lub połączyć swoje rozszerzenia w jedno konto poprzez <strong><a href="%1$s" title="Dokumentacja udostępniania">udostępnienie</a> lub <a href="%2$s" title="Dokumentacja przenoszenia">przeniesienie</a></strong> tego rozszerzenia na to konto.','M j, Y'=>'j F Y','Completed'=>'Zrealizowano','Change status: '=>'Zmień status: ','The WooCommerce Helper plugin is no longer needed. <a href="%s">Manage subscriptions</a> from the extensions tab instead.'=>'Wtyczka WooCommerce Helper nie jest już potrzebna. <a href="%s">Zarządzaj subskrypcjami</a> z poziomu zakładki rozszerzeń.','Webhook topic unknown. Please select a valid topic.'=>'Tytuł webhooka nieznany. Proszę wybrać poprawny tytuł.','Delete "%s" permanently'=>'Usuń "%s" na zawsze','Continue with Jetpack'=>'Kontynuuj z użyciem Jetpack','payment setup'=>'płatności','payment setup and automated taxes'=>'płatności i automatyczne stawki podatkowe','Reasons you\'ll love Jetpack'=>'Powody, dla których polubisz Jetpack','Klarna Payments'=>'Płatności Klarna','Klarna Checkout'=>'Klarna Checkout','Email address to receive payments'=>'Adres e-mail do przyjmowania płatności','Direct payments to email address:'=>'Bezpośrednie płatności na adres e-mail:','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place. <a href="%s" target="_blank">Learn more about Square</a>.'=>'Bezpiecznie akceptuj karty kredytowe i debetowe za pomocą jednej niskiej stawki, bez niespodzianek (dostępne stawki niestandardowe). Sprzedawaj online lub offline i śledź sprzedaż oraz stany magazynowe w jednym miejscu. <a href="%s" target="_blank">Dowiedz się więcej o Square</a> .','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Wybierz jak chcesz zapłacić: zapłać teraz, zapłać później lub rozłóż na raty. Nie potrzebujesz karty kredytowej, haseł, nie masz zmartwień. <a href="%s" target="_blank">Dowiedz się więcej o Klarna</a>.','Square'=>'Square','Full checkout experience with pay now, pay later and slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Wszystkie możliwości zakupowe z natychmiastowymi, odroczonymi i częściowymi płatnościami. Bez numerów kart kredytowych, bez haseł, bez obaw. <a href="%s" target="_blank">Dowiedz się więcej o Klarna</a>.','Accept debit and credit cards in 135+ currencies, methods such as Alipay, and one-touch checkout with Apple Pay. <a href="%s" target="_blank">Learn more</a>.'=>'Akceptuj karty kredytowe i debetowe w ponad 135 walutach. Przyjmuj płatności za pomocą Alipay lub Apple Pay (one-touch checkout). <a href="%s" target="_blank">Dowiedz się więcej</a>.','I will also be selling products or services in person.'=>'Będę sprzedawać produkty lub usługi również osobiście.','Customer downloads'=>'Pliki do pobrania','Revision restored.'=>'Starsza wersja została przywrócona.','If you like, you may enter custom structures for your product URLs here. For example, using <code>shop