mplement %3$s.'=>'Klasa %1$s zapewniana przez filtr %2$s musi zawierać %3$s.','There are no shipping options available. Please ensure that your address has been entered correctly, or contact us if you need any help.'=>'Brak dostępnych metod wysyłki. Sprawdź swój adres lub skontaktuj się z nami, jeżeli potrzebujesz pomocy.','Relevance'=>'Dopasowanie','Product Tag Cloud'=>'Chmura tagów produktów','%s fee'=>'Opłata %s','This option will delete ALL of your tax rates, use with caution. This action cannot be reversed.'=>'To usunie WSZYSTKIE stawki podatkowe, proszę używaj ostrożnie. Tej akcji nie można cofnąć.','Delete tax rates'=>'Usuń stawki podatkowe','Create pages'=>'Utwórz strony','Create default WooCommerce pages'=>'Utwórz domyślne strony WooCommerce','Clear customer sessions'=>'Wyczyść sesje klientów','Page settingTerms and conditions'=>'Regulamin','Post Type Counts'=>'Liczba wpisów z podziałem na typy','Database Index Size'=>'Rozmiar indeksu bazy danych','Database Data Size'=>'Rozmiar bazy danych','Total Database Size'=>'Całkowity rozmiar bazy danych','%s failed. Contact your hosting provider.'=>'%s nieudany. Skontaktuj się ze swoim dostawcą hostingu.','Forcing downloads will keep URLs hidden, but some servers may serve large files unreliably. If supported, %1$s / %2$s can be used to serve downloads instead (server requires %3$s).'=>'Wymuszanie pobierania pozostawi adresy URL ukryte, ale niektóre serwery mogą mieć problemy z obsługą dużych plików. Jeśli są one wspierane, %1$s / %2$s mogą być użyte do obsługi pobierania (serwer wymaga %3$s).','The postal code, if any, in which your business is located.'=>'Kod pocztowy siedziby twojej firmy.','The country and state or province, if any, in which your business is located.'=>'Kraj, w którym siedzibę ma twoja firma.','The city in which your business is located.'=>'Miasto, w którym siedzibę ma twoja firma.','An additional, optional address line for your business location.'=>'Dodatkowe pole na adres siedziby twojej firmy.','The street address for your business location.'=>'Adres siedziby twojej firmy.','This is where your business is located. Tax rates and shipping rates will use this address.'=>'Lokalizacja siedziby twojej firmy. Ten adres będzie używany do obliczania podatków i wysyłki.','Store Address'=>'Adres sklepu','Update now'=>'Aktualizuj teraz','The following active plugin(s) have not declared compatibility with WooCommerce %s yet and should be updated and examined further before you proceed:'=>'Poniższe włączone wtyczki nie potwierdzają kompatybilności z WooCommerce %s i powinny być zaktualizowane i przetestowane przed kontynuacją:','Plugin'=>'Wtyczka','<strong>Heads up!</strong> The versions of the following plugins you\'re running haven\'t been tested with WooCommerce %s. Please update them or confirm compatibility before updating WooCommerce, or you may experience issues:'=>'<strong>Uwaga!</strong> Wersje poniższych wtyczek nie zostały przetestowane z najnowszą wersję WooCommerce (%s). Zaktualizuj je lub potwierdź kompatybilność przed aktualizacją WooCommerce, tak aby uniknąć problemów:','Country / State'=>'Kraj / stan','unknown'=>'nieznane','WooCommerce transients'=>'Pamięć podręczna WooCommerce','Tested up to WooCommerce version'=>'Przetestowany do wersji WooCommerce','Upload a new file'=>'Prześlij nowy plik','The file is empty or using a different encoding than UTF-8, please try again with a new file.'=>'Plik jest pusty lub nie używa kodowania znaków UTF-8, spróbuj ponownie z innym plikiem.','Refund #%1$s - %2$s by %3$s'=>'Zwrot nr %1$s - %2$s przez %3$s','Add shipping'=>'Dodaj wysyłkę','The stock has not been updated because the value has changed since editing. Product %1$d has %2$d units in stock.'=>'Stan magazynowy nie został zaktualizowany, ponieważ stan się zmienił. Stan magazynowy produktu %1$d to %2$d.','Order details manually sent to customer.'=>'Szczegóły zamówienia zostały wysłane do klienta.','Position'=>'Pozycja','Lifetime Subscription'=>'Subskrypcja bezterminowa','Sort by:'=>'Sortuj według:','Below is a list of extensions available on your WooCommerce.com account. To receive extension updates please make sure the extension is installed, and its subscription activated and connected to your WooCommerce.com account. Extensions can be activated from the <a href="%s">Plugins</a> screen.'=>'Poniżej znajduje się lista rozszerzeń dostępnych na koncie WooCommerce.com. Aby otrzymywać aktualizacje rozszerzeń, upewnij się, że rozszerzenie jest zainstalowane, a jego subskrypcja jest aktywna i połączona z kontem WooCommerce.com. Rozszerzenia można włączyć z ekranu <a href="%s">Wtyczki</a>.','Choose an action...'=>'Wybierz akcję…','Send order details to customer'=>'Wyślij szczegóły zamówienia do klienta','Transfer existing products to your new store — just import a CSV file.'=>'Przenieś istniejące produkty do nowego sklepu - wystarczy zaimportować plik CSV.','Expiring Soon'=>'Wygasa wkrótce','Update Available'=>'Dostępna aktualizacja','If you like %1$s please leave us a %2$s rating. A huge thanks in advance!'=>'Jeśli lubisz %1$s, zostaw nam ocenę %2$s. Z góry dziękujemy!','Expired'=>'Przedawniło się','Import products'=>'Import produktów','Have an existing store?'=>'Czy masz już istniejący sklep?','Create a product'=>'Utwórz produkt','Yes please!'=>'Tak, proszę!','We\'re here for you — get tips, product updates, and inspiration straight to your mailbox.'=>'Jesteśmy tu dla Ciebie — otrzymuj porady, aktualizacje produktów i inspiracje bezpośrednio do swojej skrzynki pocztowej.','You\'re ready to start selling!'=>'Możesz rozpocząć sprzedaż!','Your site might be on a private network. Jetpack can only connect to public sites. Please make sure your site is visible over the internet, and then try connecting again 🙏.'=>'Twoja witryna może być w sieci prywatnej. Jetpack może łączyć się tylko z witrynami publicznymi. Upewnij się, że witryna jest dostępna przez Internet, a następnie spróbuj połączyć się ponownie 🙏.','Sorry! We couldn\'t contact Jetpack just now 😭. Please make sure that your site is visible over the internet, and that it accepts incoming and outgoing requests via curl. You can also try to connect to Jetpack again, and if you run into any more issues, please contact support.'=>'Przepraszamy! Nie możemy skontaktować się z Jetpack 😭. Upewnij się, że twoja strona jest dostępna przez Internet oraz, że akceptuje przychodzące i wychodzące połączenia przez curl. Możesz spróbować połączyć się ponownie z Jetpack, jeśli będziesz mieć problemy, skontaktuj się ze wsparciem technicznym.','Sorry! We tried, but we couldn\'t install Jetpack for you 😭. Please go to the Plugins tab to install it, and finish setting up your store.'=>'Przepraszamy! Próbowaliśmy, ale nie możemy zainstalować Jetpack 😭. Przejdź do zakładki Wtyczki, aby połączyć z Jetpack i zakończyć konfigurację sklepu.','Sorry! We tried, but we couldn\'t connect Jetpack just now 😭. Please go to the Plugins tab to connect Jetpack, so that you can finish setting up your store.'=>'Przepraszamy! Próbowaliśmy, ale nie możemy połączyć twojego sklepu z Jetpack 😭. Przejdź do zakładki Wtyczki, aby połączyć z Jetpack i zakończyć konfigurację sklepu.','Share new items on social media the moment they\'re live in your store.'=>'Udostępnij nowe produkty na portalach społecznościowych, gdy tylko pojawią się w sklepie.','Product promotion'=>'Promocja produktów','Get an alert if your store is down for even a few minutes.'=>'Otrzymaj ostrzeżenie, jeśli Twój sklep nie działa nawet przez kilka minut.','Store monitoring'=>'Monitoring sklepu','Get insights on how your store is doing, including total sales, top products, and more.'=>'Uzyskaj informacje o tym, jak działa sklep, w tym sprzedaż, najlepsze produkty i inne.','Finish setting up your store'=>'Zakończ konfigurowanie sklepu','Sorry, we couldn\'t connect your store to Jetpack'=>'Przepraszamy, nie możemy połączyć twojego sklepu z Jetpack','Store stats'=>'Statystyki sklepu','Protect your store from unauthoriz