ctly into our bank account. Please use your Order ID as the payment reference. Your order will not be shipped until the funds have cleared in our account.'=>'Prosimy o wpłatę bezpośrednio na nasze konto bankowe. Proszę użyć numeru zamówienia jako tytułu płatności. Twoje zamówienie zostanie zrealizowane po zaksięgowaniu wpłaty na naszym koncie.','Order refunded emails are sent to customers when their orders are refunded.'=>'E-maile o zwróconych zamówieniach są wysyłane, gdy zamówienie zostanie oznaczone jako zwrócone.','Enable PayPal sandbox'=>'Włącz tryb testowy PayPal','[Order #%s]'=>'[Zamówienie %s]','Your {site_title} order #{order_number} has been partially refunded'=>'[{site_title}] Twoje zamówienie {order_number} zostało częściowo zwrócone','Your {site_title} order #{order_number} has been refunded'=>'[{site_title}] Twoje zamówienie {order_number} zostało zwrócone','Please send a check to Store Name, Store Street, Store Town, Store State / County, Store Postcode.'=>'Proszę przesłać czek na: nazwa sklepu, adres, miasto, województwo, kod pocztowy.','Failed order emails are sent to chosen recipient(s) when orders have been marked failed (if they were previously pending or on-hold).'=>'E-maile o nieudanych zamówieniach są wysyłane, gdy zamówienia zostaną oznaczone jako nieudane (gdy wcześniej były oznaczone jako w trakcie realizacji lub wstrzymane).','PDT payment completed'=>'Płatność PDT zakończona','IPN payment completed'=>'Płatność BPP (IPN) zakończona','Payment %s via IPN.'=>'Płatność przez BPP (IPN): %s.','PayPal Standard does not support your store currency.'=>'PayPal Standard nie wspiera waluty ustawionej w sklepie.','Advanced options'=>'Opcje zaawansowane','Subject'=>'Temat','Enable/Disable'=>'Włączyć/wyłączyć','Thank you for your order'=>'Dziękujemy za złożenie zamówienia','Capture'=>'Przechwyć','Flat rate'=>'Płaska stawka','Order #%s'=>'Zamówienie numer #%s','Reset password'=>'Zresetuj hasło','Payment method description that the customer will see on your