ie zadeklarowane','WooCommerce support'=>'Wsparcie WooCommerce','Child theme'=>'Motyw potomny','Page settingMy account'=>'Moje konto','Page settingShop base'=>'Strona sklepu','Default timezone is UTC'=>'Domyślną strefą czasową jest UTC','PHP max input vars'=>'PHP Max Input Vars','Server environment'=>'Środowisko serwerowe','Log directory writable'=>'Prawa zapisu do katalogu logów','WordPress environment'=>'Środowisko WordPressa','Understanding the status report'=>'Jak rozumieć raport systemu','If you are modifying WooCommerce on a parent theme that you did not build personally we recommend using a child theme. See: <a href="%s" target="_blank">How to create a child theme</a>'=>'Jeśli modyfikujesz WooCommerce lub motyw nadrzędny, którego nie jesteś autorem, polecamy używanie motywu potomnego. Zobacz: <a href="%s" target="_blank">Jak tworzyć motywy potomne</a>','The number of decimal points shown in displayed prices.'=>'Liczba punktów dziesiętnych w wyświetlanych cenach.','Missing parameter %s'=>'Brakujący parametr %s','File does not exist'=>'Plik nie istnieje','The amount of time (in seconds) that your site will spend on a single operation before timing out (to avoid server lockups)'=>'Czas (w sekundach), który twoja witryna będzie wykonywać pojedynczą operację, zanim zostanie osiągnięty limit czasu (w celu uniknięcia zawieszenia się serwera)','Page does not contain the %s shortcode.'=>'Strona nie zawiera shortcode %s.','PHP time limit'=>'Limit czasu wykonania PHP','Author URL'=>'Adres URL autora','SUHOSIN installed'=>'Zainstalowano rozszerzenie SUHOSIN','The position of the currency symbol.'=>'Pozycja symbolu waluty.','Visibility'=>'Widoczność','PHP post max size'=>'Maksymalna wielkość zapytania post w PHP','Placeholder'=>'Symbol zastępczy','Logs'=>'Dziennik zdarzeń','Visit plugin homepage'=>'Odwiedź stronę domową wtyczki','The maximum amount of memory (RAM) that your site can use at one time.'=>'Maksymalny rozmiar pamięci (RAM), z którego może korzystać witryna w