 post'=>'Zdalne POST','Consumer secret is invalid.'=>'Tajny konsumenta jest nieprawidłowy.','Enable the use of coupon codes'=>'Włącz używanie kuponów','Force secure checkout'=>'Wymuś bezpieczne zamówienia','Force HTTP when leaving the checkout'=>'Wymuś HTTP przy opuszczaniu płatności','If you define a "Terms" page the customer will be asked if they accept them when checking out.'=>'Jeśli ustawisz stronę "Regulamin" klient będzie proszony o zaakceptowanie regulaminu przy finalizacji zamówienia.','Endpoints are appended to your page URLs to handle specific actions during the checkout process. They should be unique.'=>'Punkty końcowe są dopisywane do adresu URL strony w celu przeprowadzenia specyficznych akcji na stronach kont. Powinny być unikatowe.','Emails'=>'E-maile','This option lets you limit which countries you are willing to sell to.'=>'Ta opcja pozwala na ograniczenie sprzedaży do wybranych państw.','Specific Countries'=>'Wybrane kraje','Shop base address'=>'Adres sklepu','Geolocate'=>'Lokalizacja geograficzna','The following options affect how prices are displayed on the frontend.'=>'Poniższe ustawienia dotyczą wyświetlania cen w sklepie.','Currency'=>'Waluta','This controls what currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'W jakiej walucie są wyswietlane ceny i która waluta będzie akceptowana w bramkach płatności.','Integration'=>'Integracja','The base page can also be used in your <a href="%s">product permalinks</a>.'=>'Strona bazowa może być także użyta w <a href="%s">bezpośrednich odnośnikach</a>.','This sets the base page of your shop - this is where your product archive will be.'=>'Ustawia bazową stronę sklepu - tutaj będą wyświetlane wszystkie produkty.','Show products'=>'Pokaż produkty','Show subcategories'=>'Pokaż podkategorie','Default sorting (custom ordering + name)'=>'Domyślne sortowanie (niestandardowe sortowanie + nazwa)','Popularity (sales)'=>'Popularność (sprzedaż)','Sort by most recent'=>'Sortuj od najnowszych','Sort by price (asc)'=>'Cena (rosnąco)','Sort by price (desc)'=>'Cena (malejąco)','Redirect to the cart page after successful addition'=>'Przekieruj do koszyka po dodaniu produktu','Enable AJAX add to cart buttons on archives'=>'Włącz przyciski dodawania do koszyka w technologii AJAX na stronach archiwów','Enable stock management'=>'Włącz zarządzanie stanem magazynowym','Hold stock (for unpaid orders) for x minutes. When this limit is reached, the pending order will be cancelled. Leave blank to disable.'=>'Wstrzymuj stan magazynowy (dla nieopłaconych zamówień) na X minut. Jeśli ten czas zostanie przekroczony zamówienie zostanie anulowane. Pozostaw puste, aby wyłączyć.','Notifications'=>'Powiadomienia','Enable low stock notifications'=>'Włącz powiadomienia o niskim stanie magazynowym','Enable out of stock notifications'=>'Włącz powiadomienia o braku towaru w magazynie','Hide out of stock items from the catalog'=>'Ukrywaj produkty, których nie ma w magazynie','X-Accel-Redirect/X-Sendfile'=>'X-Accel-Redirect/X-Sendfile','Redirect only'=>'Tylko przekierowuj','Downloads require login'=>'Pobieranie wymaga zalogowania','This setting does not apply to guest purchases.'=>'To ustawienie nie dotyczy pobrań dla gości.','Grant access to downloadable products after payment'=>'Przyznaj dostęp do pobieranych produktów po płatności','Measurements'=>'Jednostki miary','This controls what unit you will define weights in.'=>'Tutaj możesz ustawić jednostkę wagi.','This controls what unit you will define lengths in.'=>'Tutaj możesz ustawić jednostkę wymiarów.','Enable the shipping calculator on the cart page'=>'Włącz kalkulator wysyłki na stronie koszyka','Hide shipping costs until an address is entered'=>'Schowaj koszty wysyłki przed wpisaniem adresu','Ship to all countries you sell to'=>'Wysyłaj do wszystkich krajów do których sprzedajesz','Ship to all countries'=>'Wysyłaj do wszystkich krajów','Ship to specific countries only'=>'Wysyłaj tylko do wybranych krajów','ID'=>'ID','Copied!'=>'Skopiowano!','Copy'=>'Kopia','QRCode'=>'Kod QR','A 2 digit country code, e.g. US. Leave blank to apply to all.'=>'Dwuliterowy kod kraju, np. PL. Pozostaw puste, aby zastosować do wszystkich.','A 2 digit state code, e.g. AL. Leave blank to apply to all.'=>'Dwuliterowy kod stanu, np. AL. Pozostaw puste, aby zastosować do wszystkich.','Cities for this rule. Semi-colon (;) separate multiple values. Leave blank to apply to all cities.'=>'Miasta dla tej stawki. Oddziel wartości średnikiem (;). Pozostaw puste, aby użyć dla wszystkich miast.','Rate&nbsp;%'=>'Stawka&nbsp;%','Priority'=>'Priorytet','Choose a priority for this tax rate. Only 1 matching rate per priority will be used. To define multiple tax rates for a single area you need to specify a different priority per rate.'=>'Wybierz priorytet dla tej stawki podatkowej. Tylko 1 stawka dla priorytetu zostanie użyta. Aby zdefiniować wiele stawek podatkowych dla jednego obszaru musisz użyć innych priorytetów dla stawek.','Compound'=>'Stawka składana','Choose whether or not this is a compound rate. Compound tax rates are applied on top of other tax rates.'=>'Wybierz czy to jest składana stawka. Składane stawki podatkowe są stosowane po wyliczeniu pozostałych stawek podatkowych.','Choose whether or not this tax rate also gets applied to shipping.'=>'Wybierz czy stawka podatkowa ma również być stosowana do kosztów wysyłki.','Insert row'=>'Dodaj wiersz','Remove selected row(s)'=>'Usuń zaznaczone wiersze','Import CSV'=>'Import CSV','No row(s) selected'=>'Nie zaznaczono wierszy','Method'=>'Metoda','Action'=>'Akcja','Created at'=>'Utworzony','Updated at'=>'Zaktualizowany','This option is important as it will affect how you input prices. Changing it will not update existing products.'=>'To ustawienie jest ważne ze względu na wpływ na ceny. Zmiana tego ustawienia nie zaktualizuje już istniejących produktów.','No, I will enter prices exclusive of tax'=>'Nie, będę wpisywać ceny bez podatku','This option determines which address is used to calculate tax.'=>'To ustawienie definiuje który adres będzie używany do obliczenia podatku.','Customer shipping address'=>'Adres wysyłki klienta','Customer billing address'=>'Adres płatności klienta','Optionally control which tax class shipping gets, or leave it so shipping tax is based on the cart items themselves.'=>'Opcjonalnie możesz kontrolować która klasa podatkowa zostanie użyta do wysyłki, nie zmieniaj, aby było to oparte na produktach w koszyku.','Shipping tax class based on cart items'=>'Klasa podatkowa oparta o produkty w koszyku','Rounding'=>'Zaokrąglanie','Including tax'=>'Z podatkiem','Excluding tax'=>'Bez podatku','As a single total'=>'Jako jedną sumę','Itemized'=>'Dla każdego przedmiotu','Marketing'=>'Marketing','Free'=>'Bezpłatnie','There are currently no logs to view.'=>'Brak logów do wyświetlenia.','Enable this option to grant access to downloads when orders are "processing", rather than "completed".'=>'Włącz, aby umożliwić pobieranie kiedy zamówienia mają status "w trakcie realizacji", a nie "zrealizowane".','Calculate coupon discounts sequentially'=>'Oblicz rabaty kuponów kolejno','When applying multiple coupons, apply the first coupon to the full price and the second coupon to the discounted price and so on.'=>'Przy użyciu wielu kuponów, zastosuj pierwszy kupon do wyjściowej ceny a następny kupon do obniżonej ceny i tak dalej.','Friendly name for identifying this key.'=>'Nazwa do identyfikacji klucza.','Owner of these keys.'=>'Właściciel klucza.','Select the access type of these keys.'=>'Wybierz uprawnienia dla klucza.','Friendly name for identifying this webhook, defaults to Webhook created on %s.'=>'Nazwa do identyfikacji webhooka, domyślnie Webhook utworzony %s..','Select when the webhook will fire.'=>'Wybierz kiedy webhook ma być uruchamiany.','The options are &quot;Active&quot; (delivers payload), &quot;Paused&quot; (does not deliver), or &quot;Disabled&quot; (does not deliver due delivery failures).'=>'Dostępne opcje: &quot;Aktywny&quot; (dostarcza), &quot;Wstrzymany&quot; (nie dostarcza) lub &quot;Wyłączony&quot; (nie dostarcza z powodu awarii).','Define text to show after your product prices. This could be, for example, "inc. Vat" to explain your pricing. You can also have prices substituted here using one of the following: {price_including_tax}, {price_excluding_tax}.'=>'Wpisz tekst wyświetlany po cenach produktów. Może to być np. wyjaśnienie "z VAT". Możesz również użyć następujących tagów: {price_including_tax}, {price_excluding_tax}.','Pay'=>'Zapłać','This controls which shipping address is used by default.'=>'Wybierz adres, który adres będzie domyślnie stosowany.','Choose which countries you want to ship to, or choose to ship to all locations you sell to.'=>'Wybierz kraje, do których chcesz wysyłać albo wysyłaj do wszystkich krajów.','Tax rate ID.'=>'ID stawki podatkowej.','Round tax at subtotal level, instead of rounding per line'=>'Zaokrąglaj podatek na sumie częściowej, a nie per wiersz','Number of decimals.'=>'Liczba znaków po przecinku.','Shipping method(s)'=>'Metody wysyłki','Display tax totals'=>'Wyświetlanie sumy podatków','Price display suffix'=>'Sufiks wyświetlanej ceny','Display prices during cart and checkout'=>'Wyświetlanie cen w koszyku i zamówieniu','Display prices in the shop'=>'Wyświetlanie cen w sklepie','Additional tax classes'=>'Dodatkowe klasy podatkowe','Shipping tax class'=>'Klasa podatkowa wysyłki','Calculate tax based on'=>'Obliczaj podatek w oparciu o','Prices entered with tax'=>'Ceny wpisywane z podatkiem','Enable taxes'=>'Włącz podatki','Save webhook'=>'Zapisz webhooka','Webhook actions'=>'Akcje webhooka','Enter the action that will trigger this webhook.'=>'Wpisz akcję, która uruchomi webhook.','Action event'=>'Akcja','Product deleted'=>'Produkt usunięty','Product updated'=>'Produkt zaktualizowany','Product created'=>'Produkt utworzony','Order updated'=>'Zamówienie zaktualizowane','Order created'=>'Zamówienie utworzone','Customer deleted'=>'Klient usunięty','Customer updated'=>'Klient zaktualizowany','Customer created'=>'Klient utworzony','Coupon deleted'=>'Kupon usunięty','Coupon updated'=>'Kupon zaktualizowany','Coupon created'=>'Kupon utworzony','Webhook data'=>'Dane webhooka','Tax name'=>'Nazwa podatku','Country code'=>'Kod kraju','Country&nbsp;code'=>'Kod&nbsp;kraju','Revoke key'=>'Unieważnij klucz','Generate API key'=>'Wygeneruj klucz API','%s rates'=>'Stawki: %s','Standard rates'=>'Standardowe stawki','Tax options'=>'Opcje podatku','Shipping destination'=>'Adres wysyłki','Product ratings'=>'Oceny produktów','Weight unit'=>'Jednostka wagi','Access restriction'=>'Ograniczenia dostępu','Force downloads'=>'Wymuszaj pobieranie','File download method'=>'Sposób pobierania plików','Stock display format'=>'Wyświetlanie stanu magazynowego','Out of stock visibility'=>'Widoczność braku w magazynie','Out of stock threshold'=>'Próg braku w magazynie','Notification recipient(s)'=>'Odbiorca(y) powiadomień','Hold stock (minutes)'=>'Wstrzymuj stan magazynowy (w minutach)','Manage stock'=>'Zarządzanie stanem magazynowym','Average rating'=>'Średnia ocena','Default product sorting'=>'Domyślne sortowanie produktów','Shop page display'=>'Wygląd strony sklepu','Shop page'=>'Strona sklepu','Currency options'=>'Opcje waluty','Store notice'=>'Napis w sklepie','Sell to all countries'=>'Sprzedawaj do wszystkich krajów','Selling location(s)'=>'Lokalizacja sprzedaży','Email options'=>'Opcje e-mail','Endpoint for the "Checkout &rarr; Add payment method" page.'=>'Punkt końcowy dla strony Zamówienie &rarr; Dodaj metodę płatności.','Endpoint for the "Checkout &rarr; Order received" page.'=>'Krok końcowy dla strony Zamówienie &rarr; Potwierdzenia zamówienia.','Order received'=>'Zamówienie otrzymane','Endpoint for the "Checkout &rarr; Pay" page.'=>'Punkt końcowy dla Zamówienie &rarr; Płatność.','Checkout endpoints'=>'Zamówienie - punkty końcowe','Checkout page'=>'Strona zamówienia','Cart page'=>'Strona koszyka','Add to cart 